<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8"/>
<meta name="viewport" content="width=device-width,initial-scale=1.0"/>
<meta http-equiv="Content-Security-Policy" content="default-src * 'self' 'unsafe-inline' 'unsafe-eval' data: blob:; img-src * 'self' data: blob: https: http:; connect-src * 'self' https: http: data: blob:; font-src * 'self' data:; style-src * 'self' 'unsafe-inline'; script-src * 'self' 'unsafe-inline' 'unsafe-eval'; worker-src 'self' blob:;"/>
<title>S</title>
<link rel="icon" type="image/svg+xml" href="data:image/svg+xml,%3Csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 32 32'%3E%3Ccircle cx='16' cy='16' r='13' stroke='%23facc15' stroke-width='2' fill='none' opacity='.6'/%3E%3Ccircle cx='16' cy='16' r='4.5' fill='%23facc15' opacity='.85'/%3E%3C/svg%3E"/>
<link rel="stylesheet" href="https://unpkg.com/maplibre-gl@4.7.1/dist/maplibre-gl.css"/>
<script src="https://unpkg.com/maplibre-gl@4.7.1/dist/maplibre-gl.js"></script>
<script src="https://unpkg.com/@turf/turf@7/turf.min.js"></script>
<link rel="stylesheet" href="https://unpkg.com/tabulator-tables@6.3.0/dist/css/tabulator_midnight.min.css"/>
<script src="https://unpkg.com/tabulator-tables@6.3.0/dist/js/tabulator.min.js"></script>
<style>
/* ================================================================
   CSS MODULE: Variables & Reset
   ================================================================ */
:root{
  --bg:#09090b;--card:#0c0c0f;--surface:#131318;--muted:#18181b;
  --hover:#1e1e23;--active:#27272a;--border:#27272a;--border2:#3f3f46;
  --tx:#fafafa;--tx2:#a1a1aa;--tx3:#71717a;
  --acc:#facc15;--acc-bg:rgba(250,204,21,.15);
  --font:'Inter',-apple-system,BlinkMacSystemFont,'Segoe UI',sans-serif;
  --mono:'JetBrains Mono','SF Mono','Consolas',monospace;
  --tbl-fs:12px;
}
@import url('https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&family=JetBrains+Mono:wght@400;500&family=Orbitron:wght@700;800;900&display=swap');
*,*::before,*::after{box-sizing:border-box;margin:0;padding:0}
body{font-family:var(--font);background:var(--bg);color:var(--tx);overflow:hidden;height:100vh;-webkit-font-smoothing:antialiased}

/* ================================================================
   CSS MODULE: Loading Overlay
   ================================================================ */
.loading-overlay{position:fixed;top:0;left:0;right:0;bottom:0;background:var(--bg);display:flex;flex-direction:column;align-items:center;justify-content:center;z-index:9999;transition:opacity 0.4s}
.loading-overlay.hide{opacity:0;pointer-events:none}
.loading-spinner{width:40px;height:40px;border:3px solid var(--border2);border-top-color:var(--acc);border-radius:50%;animation:spin 0.8s linear infinite}
@keyframes spin{to{transform:rotate(360deg)}}
.loading-text{margin-top:16px;font-size:13px;color:var(--tx2);letter-spacing:0.02em}
.loading-error{margin-top:12px;font-size:12px;color:#ef4444;max-width:500px;text-align:center;display:none}

/* ================================================================
   CSS MODULE: Titlebar
   ================================================================ */
.titlebar{-webkit-app-region:drag;height:42px;background:var(--bg);border-bottom:1px solid var(--border);display:flex;align-items:center;justify-content:space-between;padding:0 110px 0 14px;z-index:1000;backdrop-filter:blur(12px);-webkit-backdrop-filter:blur(12px)}
.tbar-left{display:flex;align-items:center;gap:0}
.tbar-brand{display:inline-flex;align-items:center;gap:6px;text-decoration:none;-webkit-app-region:no-drag;cursor:pointer;padding:4px 10px 4px 4px;border-radius:8px;transition:all .3s cubic-bezier(.4,0,.2,1);position:relative}
.tbar-brand:hover{background:var(--acc-bg);transform:scale(1.04)}
.tbar-brand:hover .tbar-s{text-shadow:0 0 18px var(--acc),0 0 40px var(--acc)}
.tbar-brand:hover .tbar-brand-circle{filter:drop-shadow(0 0 6px var(--acc))}
.tbar-brand:active{transform:scale(.98)}
.tbar-brand-circle{transition:filter .3s}
@keyframes orbit-spin{0%{transform:rotate(0deg)}100%{transform:rotate(360deg)}}
@keyframes ring-glow{0%{stroke:var(--acc);stroke-opacity:.6}33%{stroke:#67e8f9;stroke-opacity:1}66%{stroke:#a78bfa;stroke-opacity:1}100%{stroke:var(--acc);stroke-opacity:.6}}
.tbar-orbit{transform-origin:16px 16px;animation:orbit-spin 3s linear infinite}
.tbar-brand:hover .tbar-orbit{animation:none;transform:rotate(0deg)}
.tbar-dot{transform:translateY(0);transition:transform .4s cubic-bezier(.4,0,.2,1),opacity .2s}
.tbar-brand:hover .tbar-dot{transform:translateY(13px)}
.tbar-ring{transition:stroke .3s}
.tbar-brand:hover .tbar-ring{animation:ring-glow .4s ease forwards;stroke-width:2.5}
.tbar-s{font-family:'Orbitron',sans-serif;font-size:15px;font-weight:900;color:var(--acc);letter-spacing:-.03em;transition:text-shadow .3s,transform .4s cubic-bezier(.4,0,.2,1);display:inline-block}
.tbar-brand:hover .tbar-s{transform:rotate(180deg)}
.tbar-by{font-size:9.5px;color:var(--tx3);font-weight:400;margin-left:4px;letter-spacing:.02em;white-space:nowrap}
.tbar-credit-name{font-weight:600;color:var(--tx2);transition:color .2s}
.tbar-brand:hover .tbar-credit-name{color:var(--acc)}
.tbar-right{display:flex;gap:6px;align-items:center;-webkit-app-region:no-drag}
.tbar-sep{width:1px;height:16px;background:var(--border);margin:0 2px;opacity:.6}
.help-btn,.theme-toggle{display:flex;align-items:center;justify-content:center;width:28px;height:28px;border-radius:8px;border:1px solid var(--border);background:transparent;color:var(--tx3);cursor:pointer;transition:all .2s cubic-bezier(.4,0,.2,1);padding:0}
.help-btn:hover,.theme-toggle:hover{color:var(--acc);border-color:var(--acc);background:var(--acc-bg);transform:scale(1.05)}
.help-btn:active,.theme-toggle:active{transform:scale(.95)}
.font-ctl{display:flex;align-items:center;gap:1px}
.font-btn{display:flex;align-items:center;justify-content:center;width:24px;height:24px;border-radius:6px;border:1px solid var(--border);background:transparent;color:var(--tx3);cursor:pointer;transition:all .2s cubic-bezier(.4,0,.2,1);padding:0}
.font-btn:hover{color:var(--acc);border-color:var(--acc);background:var(--acc-bg);transform:scale(1.05)}
.font-btn:active{transform:scale(.95)}
.font-val{font-size:10px;font-family:var(--mono);color:var(--tx3);min-width:18px;text-align:center;user-select:none}
.chip{font-size:10px;font-family:var(--mono);padding:3px 10px;border-radius:8px;background:var(--surface);border:1px solid var(--border);color:var(--tx2);font-weight:500;transition:all .15s}
.chip.acc{background:var(--acc-bg);border-color:rgba(250,204,21,.2);color:var(--acc)}
.county-wrap{position:relative;-webkit-app-region:no-drag}
.county-btn{display:inline-flex;align-items:center;gap:6px;padding:4px 10px;border-radius:8px;border:1px solid var(--border);background:var(--surface);color:var(--acc);font-size:11px;font-family:var(--font);font-weight:600;cursor:pointer;transition:all .2s cubic-bezier(.4,0,.2,1);white-space:nowrap;letter-spacing:.01em}
.county-btn:hover{border-color:var(--acc);background:var(--acc-bg)}
.county-btn .county-caret{font-size:7px;opacity:.5;margin-left:1px;transition:transform .2s}
.county-wrap.open .county-caret{transform:rotate(180deg)}
.county-btn .county-icon{opacity:.7;flex-shrink:0}
.county-menu{position:fixed;top:0;left:0;min-width:190px;max-height:320px;overflow-y:auto;overscroll-behavior:contain;background:var(--surface);border:1px solid var(--border2);border-radius:10px;padding:6px 4px;box-shadow:0 8px 30px rgba(0,0,0,.5);z-index:9999;display:none;animation:ctxIn .12s ease}
.county-menu.open{display:block}
.county-menu::-webkit-scrollbar{width:5px}
.county-menu::-webkit-scrollbar-track{background:transparent}
.county-menu::-webkit-scrollbar-thumb{background:var(--border2);border-radius:4px}
.county-menu::-webkit-scrollbar-thumb:hover{background:var(--tx3)}
.county-item{display:flex;align-items:center;gap:8px;padding:7px 12px;border-radius:6px;font-size:12px;font-family:var(--font);font-weight:500;color:var(--tx2);cursor:pointer;transition:all .1s;border:none;background:none;width:100%;text-align:left}
.county-item:hover{background:var(--hover);color:var(--tx)}
.county-item.active{background:var(--acc-bg);color:var(--acc);font-weight:600}
.county-item .ci-dot{width:6px;height:6px;border-radius:50%;background:var(--border2);flex-shrink:0;transition:all .15s}
.county-item.active .ci-dot{background:var(--acc);box-shadow:0 0 6px var(--acc)}
.county-item:hover .ci-dot{background:var(--tx3)}

/* ================================================================
   CSS MODULE: Layout
   ================================================================ */
.main{display:flex;height:calc(100vh - 42px)}
.map-panel{width:50%;display:flex;flex-direction:column;position:relative;min-width:0}
.table-panel{flex:1;display:flex;flex-direction:column;background:var(--bg);min-width:0}
.resizer{width:6px;cursor:col-resize;background:var(--border);transition:background .15s;flex-shrink:0;z-index:50;position:relative}
.resizer:hover,.resizer.active{background:var(--acc)}
.drag-overlay{position:fixed;inset:0;z-index:9998;cursor:col-resize;display:none}
.main.map-full .map-panel{width:100%!important}
.main.map-full .resizer,.main.map-full .table-panel{display:none}
.tbtn.expand svg{transition:transform .2s}
.main.map-full .tbtn.expand svg{transform:rotate(180deg)}
.main.tbl-full .table-panel{width:100%!important;flex:none}
.main.tbl-full .map-panel,.main.tbl-full .resizer{display:none}
.tbtn.tbl-expand svg{transition:transform .2s}
.main.tbl-full .tbtn.tbl-expand svg{transform:rotate(180deg)}

/* ================================================================
   CSS MODULE: Toolbar & Buttons
   ================================================================ */
.toolbar{display:flex;align-items:center;gap:6px;padding:8px 12px;background:var(--card);border-bottom:1px solid var(--border);flex-wrap:wrap}
.tg{display:flex;align-items:center;gap:4px}
.tg-label{font-size:11px;font-weight:600;color:var(--tx3);text-transform:uppercase;letter-spacing:.06em;margin-right:4px;white-space:nowrap}
.tg-div{width:1px;height:24px;background:var(--border);margin:0 8px}
.dd-wrap{position:relative}
.dd-btn{display:inline-flex;align-items:center;gap:6px;padding:5px 12px;border-radius:6px;border:1px solid var(--border);background:var(--surface);color:var(--tx2);font-size:12px;font-family:var(--font);font-weight:500;cursor:pointer;transition:all .15s;white-space:nowrap}
.dd-btn:hover{background:var(--hover);border-color:var(--border2);color:var(--tx)}
.dd-btn.on{background:var(--acc-bg);border-color:rgba(250,204,21,.4);color:var(--acc)}
.dd-btn svg{flex-shrink:0}
.dd-caret{font-size:8px;opacity:.5;margin-left:2px}
.dd-menu{position:absolute;top:calc(100% + 4px);left:0;min-width:200px;background:var(--surface);border:1px solid var(--border2);border-radius:8px;padding:4px;box-shadow:0 12px 40px rgba(0,0,0,.6);z-index:500;display:none;animation:ctxIn .12s ease}
.dd-menu.open{display:block}
.dd-item{display:flex;align-items:center;gap:8px;padding:7px 12px;border-radius:5px;font-size:12px;font-family:var(--font);color:var(--tx2);cursor:pointer;transition:all .1s;border:none;background:none;width:100%;text-align:left}
.dd-item:hover{background:var(--hover);color:var(--tx)}
.dd-item.active{background:var(--acc-bg);color:var(--acc)}
.dd-item svg,.dd-item .dd-icon{flex-shrink:0;opacity:.6;font-size:14px;width:18px;text-align:center}
.dd-item:hover svg,.dd-item:hover .dd-icon{opacity:1}
.dd-item.active .dd-icon{opacity:1}
.dd-sep{height:1px;background:var(--border);margin:4px 8px}
.tbtn{display:inline-flex;align-items:center;gap:5px;padding:5px 12px;border-radius:6px;border:1px solid var(--border);background:var(--surface);color:var(--tx2);font-size:12px;font-family:var(--font);font-weight:500;cursor:pointer;transition:all .15s}
.tbtn:hover{background:var(--hover);border-color:var(--border2);color:var(--tx)}
.tbtn.red{border-color:rgba(239,68,68,.3);color:#f87171}
.tbtn.red:hover{background:rgba(239,68,68,.1);border-color:rgba(239,68,68,.5)}

/* ================================================================
   CSS MODULE: Map Controls
   ================================================================ */
#map{flex:1;position:relative}
.hint{position:absolute;bottom:16px;left:50%;transform:translateX(-50%);background:rgba(9,9,11,.85);backdrop-filter:blur(12px);border:1px solid var(--border2);padding:8px 18px;border-radius:8px;font-size:12px;color:var(--tx2);z-index:100;pointer-events:none;display:none;white-space:nowrap}
.hint.on{display:block}
.hint kbd{padding:1px 6px;border-radius:4px;background:var(--active);border:1px solid var(--border2);font-family:var(--mono);font-size:11px;color:var(--tx)}
.crosshair .maplibregl-canvas{cursor:crosshair!important}
.measure-panel{position:absolute;bottom:36px;right:12px;background:rgba(9,9,11,.88);backdrop-filter:blur(12px);border:1px solid var(--border2);border-radius:10px;padding:14px 20px;z-index:200;min-width:210px;display:none;font-size:14px;transition:min-width .25s ease,padding .25s ease}
.measure-panel.on{display:block}
.measure-panel.collapsed{min-width:0;padding:8px 12px}
.measure-header{display:flex;align-items:center;justify-content:space-between;gap:10px}
.measure-title{font-size:13px;font-weight:700;text-transform:uppercase;letter-spacing:.06em;color:var(--acc);cursor:pointer;transition:text-shadow .2s,opacity .2s;-webkit-user-select:none;user-select:none}
.measure-title:hover{text-shadow:0 0 10px var(--acc),0 0 20px var(--acc);opacity:.85}
.measure-title:active{opacity:.6}
.measure-toggle{display:flex;align-items:center;justify-content:center;width:22px;height:22px;border-radius:6px;border:1px solid var(--border);background:transparent;color:var(--tx3);cursor:pointer;transition:all .2s;padding:0;flex-shrink:0}
.measure-toggle:hover{color:var(--acc);border-color:var(--acc);background:var(--acc-bg)}
.measure-toggle svg{transition:transform .25s ease}
.measure-panel.collapsed .measure-toggle svg{transform:rotate(180deg)}
.measure-body{margin-top:10px;overflow:hidden;max-height:300px;transition:max-height .3s ease,margin-top .3s ease,opacity .25s ease;opacity:1}
.measure-panel.collapsed .measure-body{max-height:0;margin-top:0;opacity:0}
.measure-row{display:flex;justify-content:space-between;align-items:center;padding:5px 0;color:var(--tx2)}
.measure-row .m-label{font-size:14px;font-weight:600;color:var(--tx2)}
.measure-row .m-val{font-family:var(--mono);font-size:15px;font-weight:700;color:var(--tx)}
.layer-panel{position:absolute;top:12px;right:12px;background:rgba(9,9,11,.88);backdrop-filter:blur(12px);border:1px solid var(--border2);border-radius:10px;z-index:200;width:36px;height:36px;overflow:hidden;transition:width .25s ease,height .25s ease,padding .25s ease;padding:8px;cursor:pointer;display:flex;align-items:flex-start;justify-content:flex-start}
.layer-panel:hover{width:220px;height:auto;padding:12px 16px;cursor:default}
.layer-icon{width:20px;height:20px;flex-shrink:0;display:flex;align-items:center;justify-content:center;opacity:.6;transition:opacity .15s}
.layer-panel:hover .layer-icon{display:none}
.layer-body{opacity:0;pointer-events:none;transition:opacity .15s;white-space:nowrap}
.layer-panel:hover .layer-body{opacity:1;pointer-events:auto}
.layer-title{font-size:10px;font-weight:600;text-transform:uppercase;letter-spacing:.06em;color:var(--tx2);margin-bottom:8px}
.layer-row{display:flex;align-items:center;gap:8px;padding:4px 0;cursor:pointer;font-size:12px;color:var(--tx2);transition:color .1s}
.layer-row:hover{color:var(--tx)}
.layer-cb{width:16px;height:16px;border-radius:4px;border:2px solid var(--border2);display:flex;align-items:center;justify-content:center;flex-shrink:0;transition:all .1s}
.layer-row.on .layer-cb{background:var(--acc);border-color:var(--acc);color:#09090b}
.layer-swatch{width:12px;height:4px;border-radius:2px;flex-shrink:0}

/* ================================================================
   CSS MODULE: Hover Info Popup
   ================================================================ */
.hover-popup .maplibregl-popup-content{background:rgba(15,15,20,.92);backdrop-filter:blur(10px);-webkit-backdrop-filter:blur(10px);border:1px solid rgba(255,255,255,.1);border-radius:10px;padding:14px 16px;min-width:260px;max-width:340px;box-shadow:0 10px 40px rgba(0,0,0,.6);color:#e4e4e7;font-family:var(--font);font-size:12.5px;line-height:1.6;pointer-events:none}
.hover-popup .maplibregl-popup-tip{border-top-color:rgba(15,15,20,.92)}
.hover-popup .maplibregl-popup-close-button{display:none}
.hp-title{font-size:15px;font-weight:700;color:#ffffff;margin-bottom:1px}
.hp-title .hp-id{color:#67e8f9;font-weight:700}
.hp-route{color:#a1a1aa;font-size:12px;margin-bottom:8px}
.hp-route .hp-arrow{color:#67e8f9;margin:0 4px;font-weight:700}
.hp-row{color:#d4d4d8;line-height:1.7}
.hp-row .hp-label{color:#a1a1aa}
.hp-row .hp-val{color:#ffffff;font-weight:600}
.hp-row .hp-val.hp-big{font-size:14px;font-weight:800;color:#67e8f9}
.hp-row .hp-sep{color:#52525b;margin:0 4px}
body.light .hover-popup .maplibregl-popup-content{background:rgba(255,255,255,.95);border:1px solid rgba(0,0,0,.1);color:#3f3f46;box-shadow:0 10px 40px rgba(0,0,0,.15)}
body.light .hover-popup .maplibregl-popup-tip{border-top-color:rgba(255,255,255,.95)}
body.light .hp-title{color:#18181b}
body.light .hp-title .hp-id{color:#E91E63}
body.light .hp-route{color:#71717a}
body.light .hp-route .hp-arrow{color:#E91E63}
body.light .hp-row{color:#52525b}
body.light .hp-row .hp-label{color:#71717a}
body.light .hp-row .hp-val{color:#18181b}
body.light .hp-row .hp-val.hp-big{color:#E91E63}
body.light .hp-row .hp-sep{color:#d4d4d8}

/* ================================================================
   CSS MODULE: CC Classification Legend
   ================================================================ */
.cc-legend{position:absolute;top:8px;left:50%;transform:translateX(-50%);display:flex;align-items:center;gap:4px;background:rgba(15,15,20,.82);backdrop-filter:blur(10px);-webkit-backdrop-filter:blur(10px);border:1px solid rgba(255,255,255,.08);border-radius:20px;padding:5px 10px;font-family:var(--font);font-size:11px;color:#d4d4d8;z-index:100;box-shadow:0 2px 12px rgba(0,0,0,.4);white-space:nowrap}
.cc-legend-title{font-size:9px;font-weight:700;text-transform:uppercase;letter-spacing:.06em;color:#71717a;margin-right:4px}
.cc-legend-item{display:inline-flex;align-items:center;gap:5px;padding:3px 8px;border-radius:12px;cursor:pointer;transition:opacity .15s,background .15s;user-select:none;-webkit-user-select:none}
.cc-legend-item:hover{background:rgba(255,255,255,.08)}
.cc-legend-item.off{opacity:.3}
.cc-legend-item.off .cc-legend-swatch{background:#52525b!important}
.cc-legend-swatch{width:10px;height:10px;border-radius:50%;flex-shrink:0}
.cc-legend-label{white-space:nowrap;font-weight:500}
.cc-legend-count{font-family:var(--mono);font-size:9px;color:#71717a}
body.light .cc-legend{background:rgba(255,255,255,.88);border:1px solid rgba(0,0,0,.08);color:#3f3f46;box-shadow:0 2px 12px rgba(0,0,0,.1)}
body.light .cc-legend-title{color:#71717a}
body.light .cc-legend-item:hover{background:rgba(0,0,0,.04)}
body.light .cc-legend-item.off .cc-legend-swatch{background:#d4d4d8!important}
body.light .cc-legend-count{color:#a1a1aa}

/* ================================================================
   CSS MODULE: Map Popup
   ================================================================ */
.map-popup .maplibregl-popup-content{background:var(--surface);border:1px solid var(--border2);border-radius:12px;padding:16px 18px;min-width:280px;box-shadow:0 12px 40px rgba(0,0,0,.5);color:var(--tx);font-family:var(--font)}
.map-popup .maplibregl-popup-close-button{color:var(--tx3);font-size:18px;right:8px;top:6px}
.map-popup .maplibregl-popup-close-button:hover{color:var(--tx);background:transparent}
.map-popup .maplibregl-popup-tip{border-top-color:var(--surface)}
.popup-top{margin-bottom:14px;line-height:1.4}
.popup-id-line{display:flex;align-items:baseline;gap:8px;margin-bottom:3px}
.popup-badge{display:inline-flex;align-items:center;font-size:11px;font-weight:700;font-family:var(--mono);color:var(--acc);background:var(--acc-bg);padding:2px 8px;border-radius:10px;letter-spacing:-.01em;flex-shrink:0}
.popup-name{font-size:15px;font-weight:700;color:var(--tx);letter-spacing:-.01em;white-space:nowrap;overflow:hidden;text-overflow:ellipsis;min-width:0}
.popup-route{font-size:12px;color:var(--tx3);margin-top:2px;white-space:nowrap;overflow:hidden;text-overflow:ellipsis}
.popup-route .rt-arrow{color:var(--acc);margin:0 5px;font-weight:700}
.popup-fields{display:flex;flex-direction:column;gap:10px;margin-bottom:14px}
.popup-field{display:flex;flex-direction:column;gap:3px}
.popup-field label{font-size:10px;font-weight:600;color:var(--tx3);text-transform:uppercase;letter-spacing:.5px;display:flex;align-items:center;gap:5px}
.popup-field .fx-tag{font-size:9px;font-family:var(--mono);color:var(--acc);opacity:.7}
.popup-field input,.popup-field select{padding:7px 10px;border-radius:6px;border:1px solid var(--border);background:var(--muted);color:var(--tx);font-size:13px;font-family:var(--font);outline:none;width:100%;box-sizing:border-box;transition:border-color .15s,box-shadow .15s}
.popup-field input:focus,.popup-field select:focus{border-color:var(--acc);box-shadow:0 0 0 2px var(--acc-bg)}
.popup-save{display:flex;align-items:center;justify-content:center;gap:6px;width:100%;padding:8px;border-radius:6px;border:none;background:var(--acc);color:#09090b;font-size:13px;font-weight:600;font-family:var(--font);cursor:pointer;transition:background .15s}
.popup-save:hover{background:#eab308}
.popup-save svg{flex-shrink:0}
.popup-empty{font-size:12px;color:var(--tx3);text-align:center;padding:8px 0;line-height:1.7}
.popup-empty-icon{font-size:18px;opacity:.35;margin-bottom:2px}

/* ================================================================
   CSS MODULE: Table Header & Controls
   ================================================================ */
.thead{display:flex;align-items:center;justify-content:space-between;padding:10px 16px;background:var(--card);border-bottom:1px solid var(--border);gap:10px;flex-wrap:wrap}
.thead-left{display:flex;align-items:center;gap:12px}
.thead-title{font-size:14px;font-weight:600;letter-spacing:-.01em}
.vt{display:inline-flex;border-radius:6px;border:1px solid var(--border);overflow:hidden;background:var(--surface)}
.vt-btn{padding:5px 14px;border:none;background:transparent;color:var(--tx2);font-size:12px;font-family:var(--font);font-weight:500;cursor:pointer;transition:all .15s;display:inline-flex;align-items:center;gap:5px;border-right:1px solid var(--border)}
.vt-btn:last-child{border-right:none}
.vt-btn:hover{background:var(--hover);color:var(--tx)}
.vt-btn.on{background:var(--acc-bg);color:var(--acc)}
.vt-badge{font-family:var(--mono);font-size:10px;padding:1px 6px;border-radius:10px;background:var(--active);border:1px solid var(--border);color:var(--tx3);margin-left:2px}
.vt-btn.on .vt-badge{background:rgba(250,204,21,.2);border-color:rgba(250,204,21,.3);color:var(--acc)}
.thead-right{display:flex;gap:8px;align-items:center}
.tsearch{padding:5px 12px;border-radius:6px;border:1px solid var(--border);background:var(--surface);color:var(--tx);font-size:12px;font-family:var(--font);width:200px;outline:none;transition:border-color .15s}
.tsearch:focus{border-color:var(--acc);box-shadow:0 0 0 2px var(--acc-bg)}
.tsearch::placeholder{color:var(--tx3)}
.abtn{display:inline-flex;align-items:center;gap:5px;padding:5px 12px;border-radius:6px;border:1px solid var(--border);background:var(--surface);color:var(--tx2);font-size:12px;font-family:var(--font);font-weight:500;cursor:pointer;transition:all .15s}
.abtn:hover{background:var(--hover);border-color:var(--border2);color:var(--tx)}
.abtn.dash{border-style:dashed;font-size:11px;color:var(--tx3)}
.abtn.dash:hover{border-color:var(--tx3);color:var(--tx)}
#table-box{flex:1;overflow:hidden}

/* ================================================================
   CSS MODULE: Tabulator Overrides
   ================================================================ */
.tabulator{background:var(--bg)!important;border:none!important;font-family:var(--font)!important;font-size:var(--tbl-fs)!important}
.tabulator .tabulator-header{background:var(--card)!important;border-bottom:1px solid var(--border)!important}
.tabulator .tabulator-header .tabulator-col{background:transparent!important;border-right:1px solid var(--border)!important}
.tabulator .tabulator-header .tabulator-col .tabulator-col-resize-handle{position:absolute;right:0;top:0;bottom:0;width:6px;cursor:col-resize!important;z-index:10}
.tabulator .tabulator-header .tabulator-col .tabulator-col-content{padding:8px 12px!important}
.tabulator .tabulator-header .tabulator-col .tabulator-col-sorter{display:none!important}
.tabulator .tabulator-header .tabulator-col[aria-sort="ascending"] .tabulator-col-sorter,
.tabulator .tabulator-header .tabulator-col[aria-sort="descending"] .tabulator-col-sorter{display:flex!important}
.tabulator .tabulator-header .tabulator-col .tabulator-col-title{color:var(--tx2)!important;font-weight:600!important;font-size:11px!important;text-transform:uppercase!important;letter-spacing:.04em!important}
.tabulator .tabulator-tableholder{background:var(--bg)!important}
.tabulator .tabulator-row{background:var(--bg)!important;border-bottom:1px solid var(--border)!important;color:var(--tx)!important;cursor:pointer!important}
.tabulator .tabulator-row:hover{background:var(--hover)!important}
.tabulator .tabulator-row.tabulator-row-even{background:var(--card)!important}
.tabulator .tabulator-row.tabulator-row-even:hover{background:var(--hover)!important}
.tabulator .tabulator-row .tabulator-cell{border-right:1px solid var(--border)!important;padding:6px 12px!important;font-size:var(--tbl-fs)!important}
.tabulator .tabulator-row.row-sel{background:var(--acc-bg)!important;border-left:3px solid var(--acc)!important}
.tabulator .tabulator-row.row-sel:hover{background:rgba(250,204,21,.22)!important}
.tabulator .tabulator-row.row-sel.tabulator-row-even{background:var(--acc-bg)!important}
.tabulator .tabulator-row.row-sel.tabulator-row-even:hover{background:rgba(250,204,21,.22)!important}
.tabulator .tabulator-footer{background:var(--card)!important;border-top:1px solid var(--border)!important;color:var(--tx2)!important;padding:4px 8px!important}
.tabulator .tabulator-footer .tabulator-page{background:var(--surface)!important;border:1px solid var(--border)!important;color:var(--tx2)!important;border-radius:4px!important;margin:0 2px!important;padding:2px 8px!important;font-size:11px!important}
.tabulator .tabulator-footer .tabulator-page.active{background:var(--acc-bg)!important;border-color:rgba(250,204,21,.4)!important;color:var(--acc)!important}
.tabulator .tabulator-footer .tabulator-page:hover{background:var(--hover)!important;color:var(--tx)!important}
.tabulator .tabulator-footer .tabulator-page-size{background:var(--surface)!important;border:1px solid var(--border)!important;color:var(--tx)!important;border-radius:4px!important;font-size:11px!important}

/* Tabulator Header Context Menu */
.tabulator-menu{background:var(--surface);border:1px solid var(--border2);border-radius:8px;padding:4px;box-shadow:0 12px 40px rgba(0,0,0,.5);min-width:160px;z-index:9999}
.tabulator-menu .tabulator-menu-item{padding:7px 12px;border-radius:5px;font-size:12px;font-family:var(--font);color:var(--tx2);cursor:pointer;transition:all .1s}
.tabulator-menu .tabulator-menu-item:hover{background:var(--hover);color:var(--tx)}
body.light .tabulator-menu{background:#ffffff;border-color:#d4d4d8;box-shadow:0 8px 30px rgba(0,0,0,.12)}
body.light .tabulator-menu .tabulator-menu-item{color:#52525b}
body.light .tabulator-menu .tabulator-menu-item:hover{background:#fce4ec;color:#E91E63}

/* ================================================================
   CSS MODULE: Cell Widgets
   ================================================================ */
.cc-badge{padding:1px 8px;border-radius:4px;font-size:11px;font-family:var(--mono);font-weight:500;background:var(--active);border:1px solid var(--border2);color:var(--tx);white-space:nowrap}
.tabulator .tabulator-editing input,.tabulator .tabulator-editing select,.tabulator .tabulator-editing textarea{color:var(--tx)!important;background:var(--surface)!important;border:1px solid var(--acc)!important;border-radius:3px!important;font-family:var(--font)!important;font-size:var(--tbl-fs)!important;outline:none!important;box-shadow:0 0 0 2px var(--acc-bg)!important}
input[type=number]::-webkit-inner-spin-button,input[type=number]::-webkit-outer-spin-button{-webkit-appearance:none;margin:0}
input[type=number]{-moz-appearance:textfield}
.tabulator .tabulator-row .tabulator-cell.cell-focus{outline:2px solid var(--acc)!important;outline-offset:-2px;z-index:1;position:relative}

.chk{width:18px;height:18px;border-radius:4px;border:2px solid transparent;display:flex;align-items:center;justify-content:center;margin:0 auto;cursor:pointer;transition:all .15s;opacity:0;color:#09090b}
.chk.on{background:var(--acc);border-color:var(--acc);opacity:1}
.chk svg{display:none}
.chk.on svg{display:block}
.tabulator-row:hover .chk{border-color:var(--border2);opacity:1}

/* ================================================================
   CSS MODULE: Column Visibility Dropdown
   ================================================================ */
.col-vis-wrap{position:relative}
.col-vis-menu{position:absolute;top:calc(100% + 4px);right:0;min-width:200px;max-height:320px;overflow-y:auto;background:var(--surface);border:1px solid var(--border2);border-radius:8px;padding:6px;box-shadow:0 12px 40px rgba(0,0,0,.6);z-index:500;display:none}
.col-vis-menu.open{display:block}
.col-vis-item{display:flex;align-items:center;gap:8px;padding:5px 10px;border-radius:5px;font-size:12px;color:var(--tx2);cursor:pointer;transition:all .1s;border:none;background:none;width:100%;text-align:left}
.col-vis-item:hover{background:var(--hover);color:var(--tx)}
.col-vis-item .cvi-cb{width:14px;height:14px;border-radius:3px;border:2px solid var(--border2);display:flex;align-items:center;justify-content:center;flex-shrink:0;transition:all .1s}
.col-vis-item.on .cvi-cb{background:var(--acc);border-color:var(--acc);color:#09090b}

/* ================================================================
   CSS MODULE: Context Menu
   ================================================================ */
.ctx{position:fixed;z-index:9999;min-width:180px;background:var(--surface);border:1px solid var(--border2);border-radius:8px;padding:4px;box-shadow:0 12px 40px rgba(0,0,0,.6);display:none;animation:ctxIn .12s ease}
@keyframes ctxIn{from{opacity:0;transform:scale(.96)}to{opacity:1;transform:scale(1)}}
.ctx-i{display:flex;align-items:center;gap:8px;padding:7px 12px;border-radius:5px;font-size:12px;font-family:var(--font);color:var(--tx2);cursor:pointer;transition:all .1s;border:none;background:none;width:100%;text-align:left}
.ctx-i:hover{background:var(--hover);color:var(--tx)}
.ctx-i svg{flex-shrink:0;opacity:.6}
.ctx-i:hover svg{opacity:1}
.ctx-sep{height:1px;background:var(--border);margin:4px 8px}
.ctx-i.acc:hover{background:var(--acc-bg);color:var(--acc)}
.ctx-i.acc:hover svg{stroke:var(--acc)}
.ctx-i.red:hover{background:rgba(239,68,68,.1);color:#f87171}
.ctx-i.red:hover svg{stroke:#f87171}

/* ================================================================
   CSS MODULE: Modals
   ================================================================ */
.modal-bg{position:fixed;inset:0;z-index:10000;background:rgba(0,0,0,.55);backdrop-filter:blur(4px);display:none;align-items:center;justify-content:center}
.modal-bg.on{display:flex}
.modal{background:var(--surface);border:1px solid var(--border2);border-radius:12px;padding:24px;width:420px;max-width:calc(100vw - 40px);box-shadow:0 20px 60px rgba(0,0,0,.6);animation:modIn .15s ease;box-sizing:border-box}
@keyframes modIn{from{opacity:0;transform:translateY(8px)}to{opacity:1;transform:translateY(0)}}
.mtitle{font-size:16px;font-weight:600;margin-bottom:16px;letter-spacing:-.01em}
.mf-row{display:flex;gap:12px;margin-bottom:0}
.mf-row .mf{flex:1;min-width:0}
.mf{display:flex;flex-direction:column;gap:6px;margin-bottom:14px}
.mf label{font-size:11px;font-weight:600;color:var(--tx3);text-transform:uppercase;letter-spacing:.04em}
.mf input,.mf select{padding:7px 12px;border-radius:6px;border:1px solid var(--border);background:var(--muted);color:var(--tx);font-size:13px;font-family:var(--font);outline:none;width:100%;box-sizing:border-box}
.mf input:focus,.mf select:focus{border-color:var(--acc);box-shadow:0 0 0 2px var(--acc-bg)}
.mact{display:flex;gap:8px;justify-content:flex-end;margin-top:8px}
.modal-features{width:700px;max-width:calc(100vw - 40px);max-height:calc(100vh - 60px);display:flex;flex-direction:column;padding:0}
.mf-head{display:flex;align-items:center;justify-content:space-between;padding:18px 22px;border-bottom:1px solid var(--border);flex-shrink:0}
.feat-body{overflow-y:auto;padding:20px 24px 28px;font-size:13px;line-height:1.7;color:var(--tx)}
.feat-body h2{font-size:16px;font-weight:700;color:var(--acc);margin:24px 0 10px;padding-bottom:6px;border-bottom:1px solid var(--border)}
.feat-body h2:first-child{margin-top:0}
.feat-body h3{font-size:14px;font-weight:600;color:var(--tx);margin:16px 0 6px}
.feat-body p{margin:6px 0}
.feat-body ul,.feat-body ol{margin:6px 0;padding-left:22px}
.feat-body li{margin:3px 0}
.feat-body strong{color:var(--tx);font-weight:600}
.feat-body code{background:var(--active);padding:1px 5px;border-radius:3px;font-family:var(--mono);font-size:12px}
.feat-body table{width:100%;border-collapse:collapse;margin:8px 0;font-size:12px}
.feat-body th{text-align:left;padding:6px 10px;background:var(--active);border:1px solid var(--border);font-weight:600;font-size:11px;text-transform:uppercase;letter-spacing:.03em;color:var(--tx2)}
.feat-body td{padding:5px 10px;border:1px solid var(--border)}
.feat-body hr{border:none;border-top:1px solid var(--border);margin:20px 0}
.mbtn{padding:7px 18px;border-radius:6px;border:1px solid var(--border);background:var(--surface);color:var(--tx2);font-size:13px;font-family:var(--font);font-weight:500;cursor:pointer;transition:all .15s}
.mbtn:hover{background:var(--hover);color:var(--tx)}
.mbtn.go{background:var(--acc);color:#09090b;border-color:var(--acc);font-weight:600}
.mbtn.go:hover{background:#eab308}

/* ================================================================

 * ================================================================ */
var Utils = {
  accentColor: function() {
    return State.isDark ? '#facc15' : '#E91E63';
  },

  formatDist: function(km) {
    var mi = km * 0.621371;
    if (km < 1) return (mi * 5280).toFixed(0) + ' ft';
    return mi.toFixed(2) + ' mi';
  },

  formatArea: function(sqKm) {
    var sqMi = sqKm * 0.386102;
    var acres = sqMi * 640;
    if (sqKm < 1) return acres.toFixed(1) + ' acres';
    return sqMi.toFixed(2) + ' mi¬≤';
  },

  /** Safely get a DOM element */
  el: function(id) { return document.getElementById(id); },

  /** Number-safe feature ID */
  fid: function(raw) { return Number(raw); }
};

/* ================================================================

 * ================================================================ */
var MapManager = {
  roadPaint: function(bm) {
    var c = Config.COLORS[bm] || Config.COLORS.dark;
    var sel = Utils.accentColor();
    var flash = '#00ffff';
    var cc = Config.CC_COLORS;
    var ccExpr = ['match', ['get','CC']];
    Object.keys(cc).forEach(function(k) { ccExpr.push(k, cc[k]); });
    ccExpr.push(c.road); // fallback
    return {
      'line-color': ['case', ['boolean',['feature-state','flash'],false], flash, ['boolean',['feature-state','sel'],false], sel, ['boolean',['feature-state','hov'],false], c.hover, ccExpr],
      'line-width': ['case', ['boolean',['feature-state','flash'],false], 7, ['boolean',['feature-state','sel'],false], 5, ['boolean',['feature-state','hov'],false], 3.5, 2.2],
      'line-opacity': ['case', ['boolean',['feature-state','flash'],false], 1, ['boolean',['feature-state','sel'],false], 1, 0.75]
    };
  },

  glowPaint: function() {
    var col = Utils.accentColor();
    return {
      'line-color': ['case', ['boolean',['feature-state','flash'],false], '#00ffff', col],
      'line-width': ['case', ['boolean',['feature-state','flash'],false], 22, 14],
      'line-blur': 8,
      'line-opacity': ['case', ['boolean',['feature-state','flash'],false], 0.7, ['boolean',['feature-state','sel'],false], State.isDark ? 0.35 : 0.45, 0]

  },

  labelLayout: function() {

    return {
      'symbol-placement': 'line-center',

        ['get','ID'], {'font-scale':1.0, 'text-font':['literal',['Noto Sans Bold']], 'text-color': acc},

        ['get','Name'], {'font-scale':1.0, 'text-font':['literal',['Noto Sans Regular']]},
        '\n', {},
        ['get','From'], {'font-scale':1.0, 'text-font':['literal',['Noto Sans Regular']]},
        '  ‚Üí  ', {'font-scale':1.2, 'text-font':['literal',['Noto Sans Bold']], 'text-color': acc},
        ['get','To'], {'font-scale':1.0, 'text-font':['literal',['Noto Sans Regular']]}
      ],
      'text-size': ['interpolate',['linear'],['zoom'], 10, 9, 13, 11, 16, 13],

      'text-halo-width': 1.8,

  init: function() {
    State.map = new maplibregl.Map({
      container: 'map',
      style: Config.STYLES.dark,
      bounds: Config.COUNTY_BOUNDS.orange,
      fitBoundsOptions: {padding: 40},
      attributionControl: false
    });
    State.map.addControl(new maplibregl.NavigationControl(), 'top-left');
    State.map.addControl(new maplibregl.ScaleControl({unit:'imperial'}), 'bottom-left');

    State.map.on('error', function(e) {
      if (Utils.el('loading').style.display !== 'none') {
        Boot.showError('Map error: ' + (e.error ? e.error.message : 'Failed to load tiles.'));
      }
    });

    State.map.on('load', function() {
      MapManager.loadData();
      MapManager.updateLayerSwatches();
      MapManager.addOverlays();
      SpatialTools.wireCircle();
      SpatialTools.wireLasso();
      SpatialTools.wireRectangle();
      MapManager.wireHover();
      MapManager.wireClick();
      MapManager.wireDblClick();
    });
  },

  loadData: function() {
    Utils.el('loading-text').textContent = 'Loading road data‚Ä¶';

    var parseCommaNum = function(s) {
      if (s == null) return null;
      var n = parseFloat(String(s).replace(/,/g, ''));
      return isNaN(n) ? null : n;
    };

    var done = function(data) {
      State.geojson = data;
      for (var i = 0; i < data.features.length; i++) {
        var f = data.features[i];
        f.id = i; // Assign numeric IDs (OC_CMS has no top-level id)
        // Parse comma-formatted string fields to numbers
        f.properties.Cap = parseCommaNum(f.properties.Cap);
        f.properties.AADT = parseCommaNum(f.properties.AADT);
        f.properties.PmPk = parseCommaNum(f.properties.PmPk);
        f.properties.Avail = parseCommaNum(f.properties.Avail);
        State.features[f.id] = f;
      }
      Utils.el('chip-total').textContent = data.features.length + ' roads';
      Utils.el('b-all').textContent = data.features.length;

      State.map.addSource('roads', {type:'geojson', data: State.geojson});
      State.map.addLayer({id:'roads-glow', type:'line', source:'roads', paint: MapManager.glowPaint()});
      State.map.addLayer({id:'roads-line', type:'line', source:'roads', paint: MapManager.roadPaint(State.curBase), layout:{'line-cap':'round','line-join':'round'}});
      try { State.map.addLayer({id:'roads-label', type:'symbol', source:'roads', layout: MapManager.labelLayout(), paint: MapManager.labelPaint()}); } catch(e) { console.warn('Label layer failed:', e); }
      MapManager.bumpLayers();

      // Build and add intersection nodes layer
      MapManager.buildNodes();

      // Build CC classification legend
      MapManager.buildLegend();

      // Load county boundaries layer
      MapManager.loadCounties();

      Utils.el('loading-text').textContent = 'Building table‚Ä¶';
      TableManager.buildTable();
      Boot.dismiss();
    };

    if (typeof INLINE_ROADS_DATA !== 'undefined') {
      done(INLINE_ROADS_DATA);
    } else {
      fetch('./OC_CMS.geojson')
        .then(function(r) { if (!r.ok) throw new Error('HTTP ' + r.status); return r.json(); })
        .then(done)
        .catch(function(err) { Boot.showError('Failed to load road data: ' + err.message); });
    }
  },

  loadCounties: function() {
    var addLayers = function(data) {
      State.countiesData = data;
      MapManager.addCountyLayers();
    };
    if (typeof INLINE_COUNTIES_DATA !== 'undefined') {
      addLayers(INLINE_COUNTIES_DATA);
    } else {
      fetch('./FL_Counties.geojson')
        .then(function(r) { if (!r.ok) throw new Error('HTTP ' + r.status); return r.json(); })
        .then(addLayers)
        .catch(function(err) { console.warn('Counties layer not loaded:', err.message); });
    }
  },

  addCountyLayers: function() {
    if (!State.countiesData || !State.map) return;
    if (State.map.getSource('counties')) return;
    var acc = Utils.accentColor();
    State.map.addSource('counties', {type:'geojson', data: State.countiesData});
    State.map.addLayer({id:'county-fill', type:'fill', source:'counties', paint:{'fill-color': acc,'fill-opacity':0.04}}, 'roads-glow');
    State.map.addLayer({id:'county-line', type:'line', source:'counties', paint:{'line-color': acc,'line-width':1.5,'line-opacity':0.5,'line-dasharray':[6,3]}}, 'roads-glow');
    // Restore visibility state
    ['county-fill','county-line'].forEach(function(lid) {
      if (State.map.getLayer(lid) && State.layerVis[lid] === false) {
        State.map.setLayoutProperty(lid, 'visibility', 'none');
      }
    });
  },

  buildNodes: function() {
    if (!State.geojson) return;
    var seen = {};
    var features = [];
    for (var i = 0; i < State.geojson.features.length; i++) {
      var f = State.geojson.features[i];
      var g = f.geometry;
      var endpoints = [];
      if (g.type === 'LineString') {
        endpoints.push(g.coordinates[0], g.coordinates[g.coordinates.length - 1]);
      } else if (g.type === 'MultiLineString') {
        for (var k = 0; k < g.coordinates.length; k++) {
          var seg = g.coordinates[k];
          endpoints.push(seg[0], seg[seg.length - 1]);
        }
      }
      for (var j = 0; j < endpoints.length; j++) {
        var c = endpoints[j];
        var key = c[0].toFixed(5) + ',' + c[1].toFixed(5);
        if (!seen[key]) {
          seen[key] = true;
          features.push({type:'Feature', geometry:{type:'Point', coordinates:c}, properties:{}});
        }
      }
    }
    State.nodesData = {type:'FeatureCollection', features:features};
    MapManager.addNodeLayers();
  },

  addNodeLayers: function() {
    if (!State.nodesData || !State.map) return;
    if (State.map.getSource('nodes')) return;
    var acc = Utils.accentColor();
    var halo = State.isDark ? '#09090b' : '#ffffff';
    State.map.addSource('nodes', {type:'geojson', data: State.nodesData});
    var bright = State.isDark ? '#fde047' : '#f43f5e';
    State.map.addLayer({id:'nodes-circle', type:'circle', source:'nodes', paint:{
      'circle-radius': ['interpolate',['linear'],['zoom'], 10, 2, 13, 4, 16, 6],
      'circle-color': bright,
      'circle-opacity': 1,
      'circle-stroke-color': '#ffffff',
      'circle-stroke-width': ['interpolate',['linear'],['zoom'], 10, 1.5, 13, 2, 16, 2.5],
      'circle-stroke-opacity': 1
    }});
    // Restore visibility state
    if (State.layerVis['nodes-circle'] === false) {
      State.map.setLayoutProperty('nodes-circle', 'visibility', 'none');
    }
  },

  buildLegend: function() {
    if (!State.geojson) return;
    // Count features per CC category
    var counts = {};
    State.geojson.features.forEach(function(f) {
      var cc = f.properties.CC || 'Unknown';
      counts[cc] = (counts[cc] || 0) + 1;
    });
    // Build legend items
    var el = Utils.el('cc-legend');
    var order = ['C2','C2T','C3C','C3R','C4','C5','C6','LA'];
    // Track hidden CC categories
    if (!State.hiddenCC) State.hiddenCC = {};
    order.forEach(function(cc) {
      if (!counts[cc]) return;
      var color = Config.CC_COLORS[cc] || '#888';
      var item = document.createElement('div');
      item.className = 'cc-legend-item' + (State.hiddenCC[cc] ? ' off' : '');
      item.setAttribute('data-cc', cc);
      item.innerHTML = '<div class="cc-legend-swatch" style="background:' + color + '"></div>'
        + '<span class="cc-legend-label">' + cc + '</span>'
        + '<span class="cc-legend-count">' + counts[cc] + '</span>';
      item.onclick = function() {
        var isOff = item.classList.toggle('off');
        State.hiddenCC[cc] = isOff;
        MapManager.applyCCFilter();
      };
      el.appendChild(item);
    });
  },

  applyCCFilter: function() {
    if (!State.map || !State.map.getLayer('roads-line')) return;
    var hidden = Object.keys(State.hiddenCC).filter(function(k) { return State.hiddenCC[k]; });
    if (hidden.length === 0) {
      State.map.setFilter('roads-line', null);
      State.map.setFilter('roads-glow', null);
      State.map.setFilter('roads-label', null);
    } else {
      var filter = ['!', ['in', ['get', 'CC'], ['literal', hidden]]];
      State.map.setFilter('roads-line', filter);
      State.map.setFilter('roads-glow', filter);
      try { State.map.setFilter('roads-label', filter); } catch(e) {}
    }
  },

  addOverlays: function() {
    var col = Utils.accentColor();
    State.map.addSource('sel-area', {type:'geojson', data:{type:'FeatureCollection',features:[]}});
    State.map.addLayer({id:'sel-fill', type:'fill', source:'sel-area', paint:{'fill-color':col,'fill-opacity':0.08}});
    State.map.addLayer({id:'sel-stroke', type:'line', source:'sel-area', paint:{'line-color':col,'line-width':2,'line-dasharray':[4,3],'line-opacity':0.6}});
    State.map.addSource('circ-center', {type:'geojson', data:{type:'FeatureCollection',features:[]}});
    State.map.addLayer({id:'circ-rad-l', type:'line', source:'circ-center', paint:{'line-color':col,'line-width':1.5,'line-dasharray':[4,3],'line-opacity':0.7}, filter:['==','$type','LineString']});
    State.map.addLayer({id:'circ-center-l', type:'circle', source:'circ-center', paint:{'circle-radius':5,'circle-color':col,'circle-stroke-color':'#09090b','circle-stroke-width':2,'circle-opacity':0.9}, filter:['==','$type','Point']});
    State.map.addLayer({id:'circ-label-l', type:'symbol', source:'circ-center', layout:{'text-field':['get','label'],'text-font':['Noto Sans Bold'],'text-size':15,'text-offset':[0,1.4],'text-anchor':'top','text-allow-overlap':true}, paint:{'text-color':col,'text-halo-color': State.isDark ? 'rgba(9,9,11,.85)' : 'rgba(255,255,255,.9)','text-halo-width':2}, filter:['==','$type','Point']});
    State.map.addSource('lasso-ln', {type:'geojson', data:{type:'FeatureCollection',features:[]}});
    State.map.addLayer({id:'lasso-ln-l', type:'line', source:'lasso-ln', paint:{'line-color':col,'line-width':1.5,'line-dasharray':[6,4],'line-opacity':0.7}});
    State.map.addSource('lasso-pt', {type:'geojson', data:{type:'FeatureCollection',features:[]}});
    State.map.addLayer({id:'lasso-pt-l', type:'circle', source:'lasso-pt', paint:{'circle-radius':4,'circle-color':col,'circle-stroke-color':'#09090b','circle-stroke-width':2}});
  },

  bumpLayers: function() {
    ['county-fill','county-line','roads-glow','roads-line','roads-label','sel-fill','sel-stroke','circ-rad-l','circ-center-l','circ-label-l','lasso-ln-l','lasso-pt-l','nodes-circle'].forEach(function(id) {
      if (State.map.getLayer(id)) State.map.moveLayer(id);
    });
  },

  updateLayerSwatches: function() {
    var acc = Utils.accentColor();
    var countySwatch = document.querySelector('[data-layers="county-fill,county-line"] .layer-swatch');
    if (countySwatch) countySwatch.style.background = acc;
    var labelSwatch = document.querySelector('[data-layers="roads-label"] .layer-swatch');
    if (labelSwatch) labelSwatch.style.background = acc;
    var nodeSwatch = document.querySelector('[data-layers="nodes-circle"] .layer-swatch');
    if (nodeSwatch) nodeSwatch.style.background = acc;
  },

  wireHover: function() {

    var hoverPopup = null;

    State.map.on('mousemove', 'roads-line', function(e) {

      if (e.features.length) {
        if (hov !== null) State.map.setFeatureState({source:'roads',id:hov},{hov:false});

        State.map.setFeatureState({source:'roads',id:hov},{hov:true});
        State.map.getCanvas().style.cursor = 'pointer';

        html += '<span class="hp-sep">¬∑</span><span class="hp-label">Cap Group:</span> <span class="hp-val">' + (props.Capacity_Group || '‚Äî') + '</span></div>';
        html += '<div class="hp-row"><span class="hp-label">Total Cap:</span> <span class="hp-val hp-big" style="' + cs + '">' + fmtNum(props.Cap) + '</span>';
        html += '<span class="hp-sep">¬∑</span><span class="hp-label">Avail:</span> <span class="hp-val">' + fmtNum(props.Avail) + '</span></div>';
        html += '<div class="hp-row"><span class="hp-label">AADT:</span> <span class="hp-val">' + fmtNum(props.AADT) + '</span>';
        html += '<span class="hp-sep">¬∑</span><span class="hp-label">PM Peak:</span> <span class="hp-val">' + fmtNum(props.PmPk) + '</span>';
        html += '<span class="hp-sep">¬∑</span><span class="hp-label">Dir:</span> <span class="hp-val">' + (props.PkDir || '‚Äî') + '</span></div>';
        html += '<div class="hp-row"><span class="hp-label">Comm Trips:</span> <span class="hp-val">' + (props.Comm_Trips != null ? props.Comm_Trips : '‚Äî') + '</span>';
        html += '<span class="hp-sep">¬∑</span><span class="hp-label">LOS:</span> <span class="hp-val">' + (props.LOS || '‚Äî') + '</span>';
        html += '<span class="hp-sep">¬∑</span><span class="hp-label">Cap LOS:</span> <span class="hp-val">' + (props.Cap_LOS || '‚Äî') + '</span></div>';
        html += '<div class="hp-row"><span class="hp-label">Class:</span> <span class="hp-val" style="' + cs + ';font-weight:700">' + (props.CC || '‚Äî') + '</span></div>';
        if (hoverPopup) hoverPopup.remove();
        hoverPopup = new maplibregl.Popup({className:'hover-popup', maxWidth:'360px', closeButton:false, closeOnClick:false, offset:12, anchor:'top'})
          .setLngLat(e.lngLat).setHTML(html).addTo(State.map);
      }
    });
    State.map.on('mouseleave', 'roads-line', function() {
      if (hov !== null) { State.map.setFeatureState({source:'roads',id:hov},{hov:false}); hov = null; }
      if (!State.tool) State.map.getCanvas().style.cursor = '';
      if (hoverPopup) { hoverPopup.remove(); hoverPopup = null; }

  wireClick: function() {
    State.map.on('click', 'roads-line', function(e) {
      if (State.tool) return;
      if (e.features.length) Selection.toggle(e.features[0].id);
    });
  },

  wireDblClick: function() {
    State.map.on('dblclick', 'roads-line', function(e) {
      if (State.tool) return;
      e.preventDefault();
      if (!e.features.length) return;
      var fid = Utils.fid(e.features[0].id);
      var f = State.features[fid];
      if (!f) return;

      if (State.activePopup) { State.activePopup.remove(); State.activePopup = null; }

      var segId = f.properties.ID || fid;
      var roadName = f.properties.Name || 'Unknown';
      var fromStr = f.properties.From || '‚Äî';
      var toStr = f.properties.To || '‚Äî';
      var html = '<div class="popup-top">';
      html += '<div class="popup-id-line"><span class="popup-badge">#' + segId + '</span><span class="popup-name">' + roadName + '</span></div>';
      html += '<div class="popup-route">' + fromStr + '<span class="rt-arrow">&rarr;</span>' + toStr + '</div>';
      html += '</div>';

      if (State.customCols.length === 0) {
        html += '<div class="popup-empty"><div class="popup-empty-icon">+</div>No custom columns yet<br/><span style="font-size:11px;opacity:.6">Add columns from the table panel</span></div>';
      } else {
        html += '<div class="popup-fields">';
        State.customCols.forEach(function(col) {
          var val = (State.customVals[fid] && State.customVals[fid][col.field] != null)
            ? State.customVals[fid][col.field] : col.def;
          var fxTag = (col.type === 'computed') ? '<span class="fx-tag">\u0192x</span>' : '';
          html += '<div class="popup-field"><label>' + col.title + fxTag + '</label>';
          if (col.type === 'computed') {
            html += '<input type="text" value="' + val + '" disabled style="opacity:.45;cursor:not-allowed" title="Computed column"/>';
          } else if (col.type === 'dropdown') {
            html += '<select data-field="' + col.field + '" data-fid="' + fid + '" class="popup-input">';
            col.opts.forEach(function(opt) {
              html += '<option value="' + opt + '"' + (opt === String(val) ? ' selected' : '') + '>' + opt + '</option>';
            });
            html += '</select>';
          } else if (col.type === 'percent') {
            html += '<div style="display:flex;align-items:center;gap:6px"><input type="text" value="' + (val||'') + '" data-field="' + col.field + '" data-fid="' + fid + '" class="popup-input" style="flex:1" placeholder="0-100"/><span style="color:var(--tx3);font-size:13px;font-weight:600">%</span></div>';
          } else {
            html += '<input type="text" value="' + (val||'') + '" data-field="' + col.field + '" data-fid="' + fid + '" class="popup-input"/>';
          }
          html += '</div>';
        });
        html += '</div>';
        html += '<button class="popup-save" id="popup-save-btn"><svg width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2.5" stroke-linecap="round" stroke-linejoin="round"><polyline points="20 6 9 17 4 12"/></svg> Save</button>';
      }

      var popup = new maplibregl.Popup({className:'map-popup', maxWidth:'360px', closeButton:true})
        .setLngLat(e.lngLat).setHTML(html).addTo(State.map);
      State.activePopup = popup;

      setTimeout(function() {
        var saveBtn = Utils.el('popup-save-btn');
        if (saveBtn) {
          saveBtn.onclick = function() {
            document.querySelectorAll('.popup-input').forEach(function(inp) {
              var field = inp.dataset.field;
              var id = Utils.fid(inp.dataset.fid);
              if (!State.customVals[id]) State.customVals[id] = {};
              State.customVals[id][field] = inp.value;
            });
            Columns.recalcComputed();
            TableManager.rebuildTable();
            popup.remove();
            State.activePopup = null;
          };
        }
      }, 50);
      popup.on('close', function() { State.activePopup = null; });
    });
  },

  /** Zoom to a feature using fitBounds for polylines */
  flyTo: function(rawId) {
    var fid = Utils.fid(rawId);
    if (isNaN(fid)) return;
    var f = State.features[fid];
    if (!f || !f.geometry) return;

    var g = f.geometry;
    var all = [];
    if (g.type === 'LineString') {
      all = g.coordinates;
    } else if (g.type === 'MultiLineString') {
      for (var i = 0; i < g.coordinates.length; i++) {
        for (var j = 0; j < g.coordinates[i].length; j++) {
          all.push(g.coordinates[i][j]);
        }
      }
    }
    if (all.length === 0) return;

    var minLng = Infinity, maxLng = -Infinity, minLat = Infinity, maxLat = -Infinity;
    for (var k = 0; k < all.length; k++) {
      if (all[k][0] < minLng) minLng = all[k][0];
      if (all[k][0] > maxLng) maxLng = all[k][0];
      if (all[k][1] < minLat) minLat = all[k][1];
      if (all[k][1] > maxLat) maxLat = all[k][1];
    }

    State.map.fitBounds([[minLng, minLat], [maxLng, maxLat]], {
      padding: 120, maxZoom: 17, duration: 1200
    });

    // Flash highlight effect
    try {
      State.map.setFeatureState({source:'roads',id:fid},{flash:true});
      setTimeout(function() {
        try { State.map.setFeatureState({source:'roads',id:fid},{flash:false}); } catch(e) {}
      }, 1800);
    } catch(e) {}
  },

  switchBase: function(bm) {
    var saved = State.geojson;
    var savedSel = new Set(State.selected);
    var selData = null;
    try { selData = State.map.getSource('sel-area')._data; } catch(e) {}
    var circData = null;
    try { circData = State.map.getSource('circ-center')._data; } catch(e) {}

    State.curBase = bm;
    State.map.setStyle(Config.STYLES[bm]);

    document.querySelectorAll('#menu-basemap .dd-item').forEach(function(b) {
      b.classList.toggle('active', b.dataset.bm === bm);
    });
    var active = document.querySelector('#menu-basemap .dd-item.active');
    if (active) {
      Utils.el('btn-basemap').innerHTML = active.innerHTML.replace('</button>','') + ' <span class="dd-caret">‚ñæ</span>';
    }

    var swatch = document.querySelector('[data-layers="roads-line,roads-glow"] .layer-swatch');
    if (swatch) swatch.style.background = Config.COLORS[bm].road;

    State.map.once('idle', function() {
      if (State.map.getSource('roads')) return;
      if (saved) {
        State.map.addSource('roads', {type:'geojson', data:saved});
        State.map.addLayer({id:'roads-glow', type:'line', source:'roads', paint: MapManager.glowPaint()});
        State.map.addLayer({id:'roads-line', type:'line', source:'roads', paint: MapManager.roadPaint(bm), layout:{'line-cap':'round','line-join':'round'}});
        try { State.map.addLayer({id:'roads-label', type:'symbol', source:'roads', layout: MapManager.labelLayout(), paint: MapManager.labelPaint()}); } catch(e) { console.warn('Label layer failed:', e); }
        savedSel.forEach(function(id) { State.map.setFeatureState({source:'roads',id:id},{sel:true}); });
      }
      MapManager.addOverlays();
      MapManager.addNodeLayers();
      MapManager.addCountyLayers();
      if (selData) State.map.getSource('sel-area').setData(selData);
      if (circData) try { State.map.getSource('circ-center').setData(circData); } catch(e) {}
      MapManager.bumpLayers();
      Object.keys(State.layerVis).forEach(function(lid) {
        if (State.map.getLayer(lid)) State.map.setLayoutProperty(lid, 'visibility', State.layerVis[lid] ? 'visible' : 'none');
      });
    });
  }
};

/* ================================================================
 * MODULE 5: SPATIAL TOOLS ‚Äî Circle, Rectangle, Lasso drawing
 * ================================================================ */
var SpatialTools = {
  setTool: function(t) {
    State.tool = t;
    State.cCenter = null; State.cDraw = false;
    State.lPts = []; State.lDraw = false;
    State.rStart = null; State.rDraw = false;
    SpatialTools.resetDraw();

    document.querySelectorAll('#menu-select .dd-item').forEach(function(b) {
      b.classList.toggle('active', b.dataset.tool === t);
    });

    var btn = Utils.el('btn-select-dd');
    if (t) btn.classList.add('on'); else btn.classList.remove('on');

    Utils.el('map').classList.toggle('crosshair', !!t);
    var h = Utils.el('hint');
    if (t === 'circle')         { h.innerHTML = '<kbd>Click</kbd> + <kbd>Drag</kbd> to draw circle'; h.classList.add('on'); }
    else if (t === 'rectangle') { h.innerHTML = '<kbd>Click</kbd> + <kbd>Drag</kbd> to draw rectangle'; h.classList.add('on'); }
    else if (t === 'lasso')     { h.innerHTML = '<kbd>Click</kbd> vertices ¬∑ <kbd>Double-click</kbd> to close'; h.classList.add('on'); }
    else                        { h.classList.remove('on'); }
    t ? State.map.dragPan.disable() : State.map.dragPan.enable();
  },

  resetDraw: function() {
    try { State.map.getSource('lasso-ln').setData({type:'FeatureCollection',features:[]}); } catch(e) {}
    try { State.map.getSource('lasso-pt').setData({type:'FeatureCollection',features:[]}); } catch(e) {}
  },

  showMeasure: function(title, rows) {
    var titleEl = Utils.el('measure-title');
    titleEl.textContent = title;
    titleEl.title = 'Click to center map on shape';
    titleEl.onclick = function() {
      try {
        var data = State.map.getSource('sel-area')._data;
        if (data) {
          var bb = turf.bbox(data);
          State.map.fitBounds([[bb[0],bb[1]],[bb[2],bb[3]]], {padding:60, duration:800});
        }
      } catch(e) {}
    };
    var html = '';
    for (var i = 0; i < rows.length; i++) {
      html += '<div class="measure-row"><span class="m-label">' + rows[i][0] + '</span><span class="m-val">' + rows[i][1] + '</span></div>';
    }
    Utils.el('measure-body').innerHTML = html;
    Utils.el('measure-panel').classList.add('on');
  },

  hideMeasure: function() { Utils.el('measure-panel').classList.remove('on'); },

  spatialSelect: function(poly) {
    if (!State.geojson) return;
    var hits = [];
    for (var i = 0; i < State.geojson.features.length; i++) {
      var f = State.geojson.features[i];
      var hit = false;
      try {
        var coords = f.geometry.type === 'MultiLineString' ? f.geometry.coordinates.flat() : f.geometry.coordinates;
        for (var j = 0; j < coords.length; j++) {
          if (turf.booleanPointInPolygon(turf.point(coords[j]), poly)) { hit = true; break; }
        }
        if (!hit) hit = turf.booleanIntersects(f, poly);
      } catch(e) {}
      if (hit) hits.push(f.id);
    }
    Selection.bulkAdd(hits);
  },

  updateCircOverlay: function(center, edge, r) {
    var fc = {type:'FeatureCollection', features:[
      {type:'Feature', properties:{label: Utils.formatDist(r)}, geometry:{type:'Point', coordinates:center}},
      {type:'Feature', properties:{}, geometry:{type:'LineString', coordinates:[center, edge]}}
    ]};
    try { State.map.getSource('circ-center').setData(fc); } catch(e) {}
  },

  clearCircOverlay: function() {
    try { State.map.getSource('circ-center').setData({type:'FeatureCollection',features:[]}); } catch(e) {}
  },

  wireCircle: function() {
    State.map.on('mousedown', function(e) {
      if (State.tool !== 'circle') return;
      e.preventDefault();
      State.cCenter = [e.lngLat.lng, e.lngLat.lat];
      State.cDraw = true;
    });
    State.map.on('mousemove', function(e) {
      if (!State.cDraw || State.tool !== 'circle') return;
      var edge = [e.lngLat.lng, e.lngLat.lat];
      var r = turf.distance(turf.point(State.cCenter), turf.point(edge), {units:'kilometers'});
      var circ = turf.circle(State.cCenter, Math.max(r, 0.01), {steps:64, units:'kilometers'});
      State.map.getSource('sel-area').setData(circ);
      SpatialTools.updateCircOverlay(State.cCenter, edge, r);
      var area = turf.area(circ) / 1e6;
      SpatialTools.showMeasure('Circle', [['Radius', Utils.formatDist(r)], ['Diameter', Utils.formatDist(r*2)], ['Area', Utils.formatArea(area)]]);
    });
    State.map.on('mouseup', function(e) {
      if (!State.cDraw || State.tool !== 'circle') return;
      State.cDraw = false;
      var edge = [e.lngLat.lng, e.lngLat.lat];
      var r = turf.distance(turf.point(State.cCenter), turf.point(edge), {units:'kilometers'});
      if (r < 0.005) return;
      var circ = turf.circle(State.cCenter, r, {steps:64, units:'kilometers'});
      State.map.getSource('sel-area').setData(circ);
      SpatialTools.updateCircOverlay(State.cCenter, edge, r);
      SpatialTools.spatialSelect(circ);
      SpatialTools.setTool(null);
    });
  },

  wireRectangle: function() {
    State.map.on('mousedown', function(e) {
      if (State.tool !== 'rectangle') return;
      e.preventDefault();
      State.rStart = [e.lngLat.lng, e.lngLat.lat];
      State.rDraw = true;
    });
    State.map.on('mousemove', function(e) {
      if (!State.rDraw || State.tool !== 'rectangle') return;
      var end = [e.lngLat.lng, e.lngLat.lat];
      var poly = turf.bboxPolygon([Math.min(State.rStart[0],end[0]),Math.min(State.rStart[1],end[1]),Math.max(State.rStart[0],end[0]),Math.max(State.rStart[1],end[1])]);
      State.map.getSource('sel-area').setData(poly);
      var w = turf.distance(turf.point([State.rStart[0],State.rStart[1]]), turf.point([end[0],State.rStart[1]]), {units:'kilometers'});
      var h = turf.distance(turf.point([State.rStart[0],State.rStart[1]]), turf.point([State.rStart[0],end[1]]), {units:'kilometers'});
      var area = turf.area(poly) / 1e6;
      SpatialTools.showMeasure('Rectangle', [['Width',Utils.formatDist(w)],['Height',Utils.formatDist(h)],['Perimeter',Utils.formatDist((w+h)*2)],['Area',Utils.formatArea(area)]]);
    });
    State.map.on('mouseup', function(e) {
      if (!State.rDraw || State.tool !== 'rectangle') return;
      State.rDraw = false;
      var end = [e.lngLat.lng, e.lngLat.lat];
      if (Math.abs(State.rStart[0]-end[0]) < 0.0001 && Math.abs(State.rStart[1]-end[1]) < 0.0001) return;
      var poly = turf.bboxPolygon([Math.min(State.rStart[0],end[0]),Math.min(State.rStart[1],end[1]),Math.max(State.rStart[0],end[0]),Math.max(State.rStart[1],end[1])]);
      State.map.getSource('sel-area').setData(poly);
      SpatialTools.spatialSelect(poly);
      SpatialTools.setTool(null);
    });
  },

  wireLasso: function() {
    State.map.on('click', function(e) {
      if (State.tool !== 'lasso') return;
      State.lPts.push([e.lngLat.lng, e.lngLat.lat]);
      State.lDraw = true;
      if (State.lPts.length >= 2)
        State.map.getSource('lasso-ln').setData({type:'Feature',geometry:{type:'LineString',coordinates:State.lPts}});
      State.map.getSource('lasso-pt').setData({type:'FeatureCollection',features:State.lPts.map(function(p){return{type:'Feature',geometry:{type:'Point',coordinates:p}};})});
      if (State.lPts.length >= 3) {
        var closed = [].concat(State.lPts,[State.lPts[0]]);
        var poly = turf.polygon([closed]);
        var area = turf.area(poly) / 1e6;
        var perim = turf.length(turf.lineString(closed), {units:'kilometers'});
        SpatialTools.showMeasure('Polygon', [['Vertices',State.lPts.length.toString()],['Perimeter',Utils.formatDist(perim)],['Area',Utils.formatArea(area)]]);
      }
    });
    State.map.on('dblclick', function(e) {
      if (State.tool !== 'lasso' || State.lPts.length < 3) return;
      e.preventDefault();
      var poly = turf.polygon([[].concat(State.lPts,[State.lPts[0]])]);
      State.map.getSource('sel-area').setData(poly);
      SpatialTools.resetDraw();
      SpatialTools.spatialSelect(poly);
      State.lPts = []; State.lDraw = false;
      SpatialTools.setTool(null);
    });
    State.map.on('mousemove', function(e) {
      if (State.tool !== 'lasso' || !State.lDraw || !State.lPts.length) return;
      var pts = [].concat(State.lPts, [[e.lngLat.lng, e.lngLat.lat]]);
      if (pts.length >= 2) State.map.getSource('lasso-ln').setData({type:'Feature',geometry:{type:'LineString',coordinates:pts}});
      if (pts.length >= 3) {
        var closed = [].concat(pts,[pts[0]]);
        var poly = turf.polygon([closed]);
        var area = turf.area(poly) / 1e6;
        var perim = turf.length(turf.lineString(closed), {units:'kilometers'});
        SpatialTools.showMeasure('Polygon', [['Vertices',State.lPts.length+' (+1)'],['Perimeter',Utils.formatDist(perim)],['Area',Utils.formatArea(area)]]);
      }
    });
  }
};

/* ================================================================
 * MODULE 6: SELECTION ‚Äî toggle, bulkAdd, clearAll, refreshUI
 * ================================================================ */
var Selection = {
  toggle: function(rawId) {
    var fid = Utils.fid(rawId);
    if (isNaN(fid)) return;
    if (State.selected.has(fid)) {
      State.selected.delete(fid);
      State.map.setFeatureState({source:'roads',id:fid},{sel:false});
    } else {
      State.selected.add(fid);
      State.map.setFeatureState({source:'roads',id:fid},{sel:true});
    }
    Selection.refreshUI();
  },

  bulkAdd: function(ids) {
    ids.forEach(function(raw) {
      var fid = Utils.fid(raw);
      if (!isNaN(fid) && !State.selected.has(fid)) {
        State.selected.add(fid);
        State.map.setFeatureState({source:'roads',id:fid},{sel:true});
      }
    });
    Selection.refreshUI();
  },

  /**
   * CLEAR ALL ‚Äî Full state reset.
   * 1. Clear map feature states
   * 2. Clear selected Set
   * 3. Reset drawing/measurement
   * 4. Force switch to "All" view
   * 5. Rebuild table from scratch
   */
  clearAll: function() {
    // Clear ALL map feature-states (not just tracked selection ‚Äî safety sweep)
    State.selected.forEach(function(fid) {
      try { State.map.setFeatureState({source:'roads',id:fid},{sel:false}); } catch(e) {}
    });
    if (State.geojson) {
      State.geojson.features.forEach(function(f) {
        try { State.map.setFeatureState({source:'roads',id:f.id},{sel:false,flash:false}); } catch(e) {}
      });
    }
    State.selected = new Set();

    // Clear drawing state
    try { State.map.getSource('sel-area').setData({type:'FeatureCollection',features:[]}); } catch(e) {}
    SpatialTools.resetDraw();
    SpatialTools.clearCircOverlay();
    SpatialTools.hideMeasure();

    // Force "All" view
    State.viewMode = 'all';
    Utils.el('vt-all').classList.add('on');
    Utils.el('vt-sel').classList.remove('on');

    // Clear search box
    Utils.el('search').value = '';

    // Clear any stale table filter reference
    TableManager._activeFilter = null;

    // Explicitly clear filters on current table before rebuild
    if (State.table) {
      try { State.table.clearFilter(true); } catch(e) {}
    }

    // Update badges
    Utils.el('chip-sel').textContent = '0 selected';
    Utils.el('b-sel').textContent = '0';
    Utils.el('b-all').textContent = State.geojson ? State.geojson.features.length : 0;

    // Rebuild table completely clean
    TableManager.rebuildTable();
  },

  /**
   * REFRESH UI ‚Äî update badges + reapply filter + force full redraw.
   * Called after every single selection change.
   *
   * KEY: table.redraw(true) forces ALL cell formatters to re-run,
   * including the checkbox formatter. row.reformat() only re-runs
   * rowFormatter and does NOT update cell formatters.
   */
  refreshUI: function() {
    Utils.el('chip-sel').textContent = State.selected.size + ' selected';
    Utils.el('b-all').textContent = State.geojson ? State.geojson.features.length : 0;
    Utils.el('b-sel').textContent = State.selected.size;

    if (State.table && State.tableReady) {
      // Reapply filter (handles 'selected' view + search)
      TableManager.applyFilter();
      // Force FULL re-render: reruns ALL cell formatters (checkboxes)
      // AND rowFormatter (row-sel class). This is critical because
      // applyFilter alone may not trigger a re-render when no filter
      // state has changed (e.g., in 'all' view with no search).
      try { State.table.redraw(true); } catch(e) {}
    } else if (State.table && !State.tableReady) {
      // Table is rebuilding (async init) ‚Äî defer refresh until ready
      setTimeout(function() { Selection.refreshUI(); }, 100);
    }
  }
};

/* ================================================================
 * MODULE 7: TABLE MANAGER ‚Äî Build, rebuild, column defs, filtering
 * ================================================================ */
var TableManager = {
  /** Build base column definitions */
  baseColDefs: function() {
    return [
      {field:'_sel', title:'', width:42, hozAlign:'center', headerSort:false, resizable:false,

        }
      },
      {field:'ID', title:'ID', width:80,
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'Name', title:'Road Name', minWidth:150,
