        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'To', title:'To', minWidth:130,
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'CC', title:'Class', width:90, hozAlign:'center',
        formatter:function(c){return '<span class="cc-badge">'+c.getValue()+'</span>';},
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'Capacity_Group', title:'Cap Group', minWidth:150,
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'Ln', title:'Lanes', width:70, hozAlign:'center', sorter:'number',
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'LOS', title:'LOS', width:60, hozAlign:'center',
        formatter:function(c){return '<span class="cc-badge">'+c.getValue()+'</span>';},
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'Cap', title:'Capacity', width:100, hozAlign:'right', sorter:'number',
        formatter:function(c){var v=c.getValue();return v!=null?v.toLocaleString():'‚Äî';},
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'AADT', title:'AADT', width:100, hozAlign:'right', sorter:'number',
        formatter:function(c){var v=c.getValue();return v!=null?v.toLocaleString():'‚Äî';},
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'PmPk', title:'PM Peak', width:100, hozAlign:'right', sorter:'number',
        formatter:function(c){var v=c.getValue();return v!=null?v.toLocaleString():'‚Äî';},
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'PkDir', title:'Pk Dir', width:70, hozAlign:'center',
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'Comm_Trips', title:'Comm Trips', width:100, hozAlign:'right', sorter:'number',
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'Avail', title:'Available', width:100, hozAlign:'right', sorter:'number',
        formatter:function(c){var v=c.getValue();return v!=null?v.toLocaleString():'‚Äî';},
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]},
      {field:'Cap_LOS', title:'Cap LOS', width:80, hozAlign:'center',
        formatter:function(c){return '<span class="cc-badge">'+c.getValue()+'</span>';},
        headerContextMenu:[{label:'Hide Column',action:function(e,col){UI.hideColumn(col.getField());}}]}
    ];
  },

  /** Build custom column definition for Tabulator */
  makeCustomColDef: function(col) {
    var isComputed = (col.type === 'computed');
    var def = {
      title: col.title,
      field: col.field,
      minWidth: 120,
      titleFormatter: function() {
        var tag = isComputed ? ' <span style="font-size:9px;opacity:.5">∆íx</span>' : '';
        return '<span style="display:inline-flex;align-items:center;gap:6px;width:100%">'
          + '<span style="flex:1;overflow:hidden;text-overflow:ellipsis">' + col.title + tag + '</span>'
          + '<span class="col-del" data-field="' + col.field + '" title="Delete column" style="cursor:pointer;opacity:.4;font-size:14px;line-height:1;flex-shrink:0">√ó</span>'
          + '</span>';
      },
      headerContextMenu: isComputed ? [
        {label:'Edit Formula', action:function(e,column){Columns.editFormula(col.field);}},
        {label:'Hide Column', action:function(e,column){UI.hideColumn(col.field);}},
        {label:'Remove Column', action:function(e,column){Columns.removeCol(col.field);}}
      ] : [
        {label:'Hide Column', action:function(e,column){UI.hideColumn(col.field);}},
        {label:'Remove Column', action:function(e,column){Columns.removeCol(col.field);}}
      ]
    };

    if (isComputed) {
      def.formatter = function(cell) {
        var v = cell.getValue();
        return '<span style="color:var(--acc);font-family:var(--mono);font-size:11px">' + (v != null ? v : '') + '</span>';
      };
    } else {
      def.editor = col.type === 'dropdown' ? 'list' : 'input';
      if (col.type === 'dropdown') def.editorParams = {values: col.opts, autocomplete: true};
      if (col.type === 'percent') {
        def.formatter = function(cell) {
          var v = cell.getValue();
          if (v === '' || v == null) return '';
          return '<span style="font-family:var(--mono);font-size:11px">' + v + '%</span>';
        };
        def.sorter = 'number';
      }
      if (col.type === 'number') def.sorter = 'number';

      def.cellEdited = function(cell) {
        var id = Utils.fid(cell.getRow().getData()._fid);
        if (!State.customVals[id]) State.customVals[id] = {};
        State.customVals[id][col.field] = cell.getValue();
        if (Columns.recalcComputed()) {
          TableManager.rebuildTable();
        } else {
          CellNav.moveEditorDown(cell);
        }
      };
    }
    return def;
  },

  /** Build row data from GeoJSON + customVals */
  buildRowData: function() {
    if (!State.geojson) return [];
    return State.geojson.features.map(function(f) {
      var r = {
        _fid:           f.id,
        ID:             f.properties.ID,
        Name:           f.properties.Name || '‚Äî',
        From:           f.properties.From || '‚Äî',
        To:             f.properties.To   || '‚Äî',
        CC:             f.properties.CC   || '‚Äî',
        Capacity_Group: f.properties.Capacity_Group || '‚Äî',
        Ln:             f.properties.Ln,
        LOS:            f.properties.LOS  || '‚Äî',
        Cap:            f.properties.Cap,
        AADT:           f.properties.AADT,
        PmPk:           f.properties.PmPk,
        PkDir:          f.properties.PkDir || '‚Äî',
        Comm_Trips:     f.properties.Comm_Trips,
        Avail:          f.properties.Avail,
        Cap_LOS:        f.properties.Cap_LOS || '‚Äî'
      };
      // Populate ALL custom column values from customVals (single source of truth)
      State.customCols.forEach(function(col) {
        r[col.field] = (State.customVals[f.id] && State.customVals[f.id][col.field] != null)
          ? State.customVals[f.id][col.field] : col.def;
      });
      return r;
    });
  },

  /** Merge base + custom columns respecting colOrder */
  mergeColumns: function() {
    var baseCols = TableManager.baseColDefs();
    var customDefs = State.customCols.map(function(col) { return TableManager.makeCustomColDef(col); });

    if (State.colOrder && State.colOrder.length > 0) {
      var colMap = {};
      baseCols.forEach(function(c) { colMap[c.field] = c; });
      customDefs.forEach(function(c) { colMap[c.field] = c; });
      var result = [];
      State.colOrder.forEach(function(f) {
        if (colMap[f]) { result.push(colMap[f]); delete colMap[f]; }
      });
      // Append any new columns not yet in saved order
      Object.keys(colMap).forEach(function(f) { result.push(colMap[f]); });
      return result;
    }
    return baseCols.concat(customDefs);
  },

  /**
   * BUILD TABLE ‚Äî Always builds fresh from State (customVals is truth).
   */
  buildTable: function() {
    State.tableReady = false;
    TableManager._activeFilter = null;
    if (State.table) { State.table.destroy(); State.table = null; }

    var rows = TableManager.buildRowData();
    var cols = TableManager.mergeColumns();

    State.table = new Tabulator('#table-box', {
      data: rows,
      layout: 'fitColumns',
      height: '100%',
      movableColumns: true,
      pagination: 'local',
      paginationSize: 50,
      paginationSizeSelector: [25, 50, 100, 200],
      placeholder: 'No matching roads',
      initialSort: [{column:'Name', dir:'asc'}],
      columns: cols,

      rowFormatter: function(row) {
        var el = row.getElement();
        var fid = Utils.fid(row.getData()._fid);
        if (State.selected.has(fid)) {
          el.classList.add('row-sel');
        } else {
          el.classList.remove('row-sel');
        }
      }
    });

    /**
     * TABLE EVENTS ‚Äî Tabulator 6.3 requires events to be registered
     * via table.on() rather than as constructor options.
     */

    /** CELL CLICK ‚Äî handles ALL cell clicks.
     *  For _sel column: toggles selection (checkbox).
     *  For other columns: sets cell focus for navigation. */
    State.table.on('cellClick', function(e, cell) {
      var f = cell.getColumn().getField();
      if (f === '_sel') {
        e.stopPropagation();
        Selection.toggle(Utils.fid(cell.getRow().getData()._fid));
        return;
      }
      CellNav.setFocusedCell(cell);
    });

    /** DOUBLE-CLICK ROW ‚Üí ZOOM TO SEGMENT */
    State.table.on('rowDblClick', function(e, row) {
      if (e.target.closest('.chk')) return;
      var fid = Utils.fid(row.getData()._fid);
      MapManager.flyTo(fid);
    });

    /** CELL DOUBLE-CLICK fallback ‚Äî Tabulator 6.3 sometimes fires cellDblClick
     *  instead of rowDblClick, especially for cells with editors. */
    State.table.on('cellDblClick', function(e, cell) {
      var f = cell.getColumn().getField();
      if (f === '_sel') return;
      for (var i = 0; i < State.customCols.length; i++) {
        if (State.customCols[i].field === f && State.customCols[i].type !== 'computed') return;
      }
      var fid = Utils.fid(cell.getRow().getData()._fid);
      MapManager.flyTo(fid);
    });

    /** RIGHT-CLICK ‚Üí CONTEXT MENU */
    State.table.on('rowContext', function(e, row) {
      e.preventDefault();
      UI.showCtx(e.clientX, e.clientY, Utils.fid(row.getData()._fid));
    });

    /** COLUMN MOVED ‚Äî persist column order */
    State.table.on('columnMoved', function(column, columns) {
      State.colOrder = columns.map(function(c) { return c.getField(); }).filter(Boolean);
    });

    /** TABLE BUILT ‚Äî mark ready, restore state, apply filters, restore hidden cols.
     *  Tabulator 6.3 requires the table to be fully initialized before calling
     *  methods like setSort, setPage, setPageSize. pendingRestore holds saved
     *  state from rebuildTable() that must be applied here. */
    State.table.on('tableBuilt', function() {
      State.tableReady = true;

      // Restore sort/page/pageSize saved by rebuildTable()
      if (State.pendingRestore) {
        var r = State.pendingRestore;
        State.pendingRestore = null;
        if (r.sorts && r.sorts.length) try { State.table.setSort(r.sorts); } catch(e) {}
        try { State.table.setPageSize(r.pageSize); } catch(e) {}
        try { State.table.setPage(r.page); } catch(e) {}
      }

      TableManager.applyFilter();
      State.hiddenCols.forEach(function(f) {
        try { State.table.hideColumn(f); } catch(e) {}
      });
      UI.updateColVisMenu();
    });

    // Wire column delete (one-time)
    if (!State.colDelWired) {
      State.colDelWired = true;
      Utils.el('table-box').addEventListener('click', function(e) {
        var del = e.target.closest('.col-del');
        if (del) {
          e.stopPropagation();
          var field = del.getAttribute('data-field');
          if (field && confirm('Delete this column?')) Columns.removeCol(field);
        }
      });
    }
  },

  /**
   * REBUILD TABLE ‚Äî destroy and recreate, preserving user state.
   * Saves sort, page, pageSize, colOrder before destroy.
   */
  rebuildTable: function() {
    if (!State.table) { TableManager.buildTable(); return; }

    // Save state before destroying the old table
    var sorts = [];
    try { sorts = State.table.getSorters().map(function(s) { return {column:s.field, dir:s.dir}; }); } catch(e) {}
    var page = 1;
    try { page = State.table.getPage(); } catch(e) {}
    var pageSize = 50;
    try { pageSize = State.table.getPageSize(); } catch(e) {}
    // Save column order from current table
    try {
      var curCols = State.table.getColumns().map(function(c) { return c.getField(); }).filter(Boolean);
      if (curCols.length > 0) State.colOrder = curCols;
    } catch(e) {}

    // Stash state for restoration in tableBuilt callback
    // (Tabulator 6.3 requires table to be fully built before calling setSort/setPage)
    State.pendingRestore = {sorts: sorts, page: page, pageSize: pageSize};

    // Rebuild fresh ‚Äî tableBuilt handler will restore the saved state
    TableManager.buildTable();
  },

  /** Set view mode and apply filter */
  setView: function(mode) {
    State.viewMode = mode;
    Utils.el('vt-all').classList.toggle('on', mode === 'all');
    Utils.el('vt-sel').classList.toggle('on', mode === 'selected');
    if (State.tableReady) {
      TableManager.applyFilter();
    } else {
      // Table rebuilding ‚Äî defer filter until ready
      setTimeout(function() { TableManager.applyFilter(); }, 100);
    }
  },

  /** Active filter reference ‚Äî tracked so we can cleanly remove it */
  _activeFilter: null,

  /** Apply filter based on viewMode and search query.
   *  
   *  CRITICAL: In Tabulator 6.3, function-based filters must be removed
   *  by passing the EXACT same function reference to removeFilter().
   *  We track the reference in _activeFilter for reliable removal.
   */
  applyFilter: function() {
    if (!State.table || !State.tableReady) return;

    // Step 1: Remove previous function filter by exact reference
    if (TableManager._activeFilter) {
      try { State.table.removeFilter(TableManager._activeFilter); } catch(e) {}
      TableManager._activeFilter = null;
    }
    // Step 2: Also nuke all filters as safety net
    try { State.table.clearFilter(); } catch(e) {}

    // Step 3: Add new filter if needed
    var q = Utils.el('search').value.toLowerCase();
    var vm = State.viewMode;

    if (vm === 'selected' || q) {
      var fn = function(d) {
        if (vm === 'selected' && !State.selected.has(Utils.fid(d._fid))) return false;
        if (q) {
          return (d.Name && d.Name.toLowerCase().includes(q)) ||
                 (d.ID && String(d.ID).toLowerCase().includes(q)) ||
                 (d.From && d.From.toLowerCase().includes(q)) ||
                 (d.To && d.To.toLowerCase().includes(q)) ||
                 (d.CC && d.CC.toLowerCase().includes(q)) ||
                 (d.LOS && d.LOS.toLowerCase().includes(q)) ||
                 (d.Capacity_Group && d.Capacity_Group.toLowerCase().includes(q));
        }
        return true;
      };
      TableManager._activeFilter = fn;
      try { State.table.addFilter(fn); } catch(e) {}
    }
  }
};

/* ================================================================
 * MODULE 8: COLUMNS ‚Äî Custom columns, Column Math, computation
 * ================================================================ */
var Columns = {
  removeCol: function(field) {
    State.customCols = State.customCols.filter(function(c) { return c.field !== field; });
    Object.keys(State.customVals).forEach(function(id) { delete State.customVals[id][field]; });
    if (State.colOrder) State.colOrder = State.colOrder.filter(function(f) { return f !== field; });
    TableManager.rebuildTable();
  },

  addCol: function(name, type, opts, def) {
    var field = '_c_' + name.replace(/[^a-zA-Z0-9]/g, '_') + '_' + Date.now();
    var colDef = {field: field, title: name, type: type, opts: opts, def: def};
    State.customCols.push(colDef);
    if (State.geojson) {
      State.geojson.features.forEach(function(f) {
        if (!State.customVals[f.id]) State.customVals[f.id] = {};
        State.customVals[f.id][field] = def;
      });
    }
    TableManager.rebuildTable();
  },

  /** Get all numeric columns available for Column Math */
  getNumericColumns: function() {
    var cols = [
      {field:'Ln', title:'Lanes'},
      {field:'Cap', title:'Capacity'},
      {field:'AADT', title:'AADT'},
      {field:'PmPk', title:'PM Peak'},
      {field:'Comm_Trips', title:'Comm Trips'},
      {field:'Avail', title:'Available'}
    ];
    State.customCols.forEach(function(c) {
      if (c.type === 'number' || c.type === 'percent') cols.push({field:c.field, title:c.title});
    });
    State.customCols.forEach(function(c) {
      if (c.type === 'computed') cols.push({field:c.field, title:c.title});
    });
    return cols;
  },

  /**
   * GET COLUMN VALUE ‚Äî reads from customVals (source of truth).
   *
   * Percent handling:
   *   - For * and / operations: percent columns are auto-converted to fractions
   *     (e.g., 50 ‚Üí 0.5) so that "50% √ó 100 = 50"
   *   - For % operation: NO auto-conversion. The % op formula itself does A√óB/100
   *   - For + and - operations: raw values used
   */
  getColValue: function(fid, field, feature, op) {
    var raw = 0;
    // Base numeric fields from OC_CMS properties
    var baseNumeric = {Ln:1, Cap:1, AADT:1, PmPk:1, Comm_Trips:1, Avail:1};
    if (baseNumeric[field]) {
      raw = feature ? parseFloat(feature.properties[field] || 0) : 0;
    } else if (State.customVals[fid] && State.customVals[fid][field] != null) {
      raw = parseFloat(State.customVals[fid][field]) || 0;
    }

    // Auto-convert percent to fraction for multiply/divide ONLY
    if (op === '*' || op === '/') {
      var isPercent = false;
      for (var i = 0; i < State.customCols.length; i++) {
        if (State.customCols[i].field === field && State.customCols[i].type === 'percent') {
          isPercent = true; break;
        }
      }
      if (isPercent) raw = raw / 100;
    }
    return raw;
  },

  /**
   * COMPUTE OPERATION
   * +  : A + B
   * -  : A - B
   * *  : A √ó B (percents auto-converted to fractions)
   * /  : A √∑ B (percents auto-converted to fractions)
   * %  : B% of A = A √ó B / 100
   *
   * rnd (rounding mode): 'none', 'round', 'ceil', 'floor', 'r10', 'r100', 'r1000'
   */
  computeOp: function(a, b, op, dec, rnd) {
    var r = 0;
    if (op === '+') r = a + b;
    else if (op === '-') r = a - b;
    else if (op === '*') r = a * b;
    else if (op === '/') r = (b !== 0) ? a / b : 0;
    else if (op === '%') r = a * b / 100;

    // Apply rounding
    if (rnd === 'round')     r = Math.round(r);
    else if (rnd === 'ceil') r = Math.ceil(r);
    else if (rnd === 'floor') r = Math.floor(r);
    else if (rnd === 'r10')  r = Math.round(r / 10) * 10;
    else if (rnd === 'r100') r = Math.round(r / 100) * 100;
    else if (rnd === 'r1000') r = Math.round(r / 1000) * 1000;

    return parseFloat(r.toFixed(dec));
  },

  /**
   * RECALCULATE ALL COMPUTED COLUMNS
   * Iterates through all computed columns and updates customVals.
   * Returns true if any values changed.
   */
  recalcComputed: function() {
    if (!State.geojson) return false;
    var dirty = false;
    State.customCols.forEach(function(col) {
      if (col.type !== 'computed' || !col.formula) return;
      var fm = col.formula;
      State.geojson.features.forEach(function(f) {
        if (!State.customVals[f.id]) State.customVals[f.id] = {};
        var va = Columns.getColValue(f.id, fm.a, f, fm.op);
        var vb = (fm.b === '_CONST_') ? (fm.constVal || 0) : Columns.getColValue(f.id, fm.b, f, fm.op);
        var nv = Columns.computeOp(va, vb, fm.op, fm.dec, fm.rnd || 'none');
        if (State.customVals[f.id][col.field] !== nv) {
          State.customVals[f.id][col.field] = nv;
          dirty = true;
        }
      });
    });
    return dirty;
  },

  /** Create a Column Math computed column */
  addMathCol: function(name, fieldA, fieldB, isConst, constVal, op, dec, rnd) {
    var field = '_c_' + name.replace(/[^a-zA-Z0-9]/g, '_') + '_' + Date.now();
    var colDef = {
      field: field, title: name, type:'computed', opts:[], def:'0',
      formula: {a:fieldA, b:isConst?'_CONST_':fieldB, op:op, dec:dec, constVal:constVal, rnd:rnd||'none'}
    };
    State.customCols.push(colDef);

    if (State.geojson) {
      State.geojson.features.forEach(function(f) {
        if (!State.customVals[f.id]) State.customVals[f.id] = {};
        var va = Columns.getColValue(f.id, fieldA, f, op);
        var vb = isConst ? constVal : Columns.getColValue(f.id, fieldB, f, op);
        State.customVals[f.id][field] = Columns.computeOp(va, vb, op, dec, rnd||'none');
      });
    }
    TableManager.rebuildTable();
  },

  /** Update an existing computed column formula */
  updateFormula: function(field, name, fieldA, fieldB, isConst, constVal, op, dec, rnd) {
    var col = null;
    for (var i = 0; i < State.customCols.length; i++) {
      if (State.customCols[i].field === field) { col = State.customCols[i]; break; }
    }
    if (!col) return;
    col.title = name;
    col.formula = {a:fieldA, b:isConst?'_CONST_':fieldB, op:op, dec:dec, constVal:constVal, rnd:rnd||'none'};
    if (State.geojson) {
      State.geojson.features.forEach(function(f) {
        if (!State.customVals[f.id]) State.customVals[f.id] = {};
        var va = Columns.getColValue(f.id, fieldA, f, op);
        var vb = isConst ? constVal : Columns.getColValue(f.id, fieldB, f, op);
        State.customVals[f.id][field] = Columns.computeOp(va, vb, op, dec, rnd||'none');
      });
    }
    TableManager.rebuildTable();
  },

  /** Open Column Math modal in edit mode for an existing computed column */
  editFormula: function(field) {
    var col = null;
    for (var i = 0; i < State.customCols.length; i++) {
      if (State.customCols[i].field === field) { col = State.customCols[i]; break; }
    }
    if (!col || col.type !== 'computed' || !col.formula) return;
    var fm = col.formula;
    var cols = Columns.getNumericColumns();
    if (cols.length < 1) return;
    UI.populateMathDropdowns();
    Utils.el('cm-name').value = col.title;
    Utils.el('cm-a').value = fm.a;
    Utils.el('cm-op').value = fm.op;
    if (fm.b === '_CONST_') {
      Utils.el('cm-b').value = '_CONST_';
      Utils.el('cm-const').value = fm.constVal;
      Utils.el('cm-const-wrap').style.display = 'flex';
    } else {
      Utils.el('cm-b').value = fm.b;
      Utils.el('cm-const-wrap').style.display = 'none';
    }
    Utils.el('cm-dec').value = fm.dec;
    Utils.el('cm-round').value = fm.rnd || 'none';
    State._editingFormulaField = field;
    Utils.el('cm-ok').textContent = 'Update Column';
    UI.updateMathPreview();
    Utils.el('modal-math').classList.add('on');
    setTimeout(function() { Utils.el('cm-name').focus(); }, 100);
  }
};

/* ================================================================
 * MODULE 9: CELL NAVIGATION ‚Äî Arrow keys, Enter-to-edit, focus
 * ================================================================ */
var CellNav = {
  setFocusedCell: function(cell) {
    if (State.focusedCell) {
      try { State.focusedCell.getElement().classList.remove('cell-focus'); } catch(e) {}
    }
    State.focusedCell = cell;
    if (cell) {
      cell.getElement().classList.add('cell-focus');
      try { cell.getElement().scrollIntoView({block:'nearest',inline:'nearest'}); } catch(e) {}
    }
  },

  getVisibleColumns: function() {
    if (!State.table) return [];
    return State.table.getColumns().filter(function(c) {
      var f = c.getField();
      return f && f !== '_sel' && c.isVisible();
    });
  },

  navigateCell: function(rowDir, colDir) {
    if (!State.focusedCell || !State.table) return;
    var field = State.focusedCell.getColumn().getField();
    var curRow = State.focusedCell.getRow();
    var rows = State.table.getRows('visible');
    var visCols = CellNav.getVisibleColumns();

    var rowIdx = -1, colIdx = -1;
    for (var i = 0; i < rows.length; i++) {
      if (rows[i] === curRow || rows[i].getPosition() === curRow.getPosition()) { rowIdx = i; break; }
    }
    for (var j = 0; j < visCols.length; j++) {
      if (visCols[j].getField() === field) { colIdx = j; break; }
    }
    if (rowIdx < 0 || colIdx < 0) return;

    var newRow = rowIdx + rowDir;
    var newCol = colIdx + colDir;
    if (newRow < 0 || newRow >= rows.length) return;
    if (newCol < 0 || newCol >= visCols.length) return;

    var nextCell = rows[newRow].getCell(visCols[newCol].getField());
    if (nextCell) CellNav.setFocusedCell(nextCell);
  },

  moveEditorDown: function(cell) {
    var field = cell.getColumn().getField();
    var curFid = Utils.fid(cell.getRow().getData()._fid);
    var rows = State.table.getRows('visible');
    var found = false;
    for (var i = 0; i < rows.length; i++) {
      if (found) {
        var nextCell = rows[i].getCell(field);
        if (nextCell) {
          CellNav.setFocusedCell(nextCell);
          setTimeout(function() { try { nextCell.edit(); } catch(e) {} }, 50);
        }
        return;
      }
      if (Utils.fid(rows[i].getData()._fid) === curFid) found = true;
    }
  }
};

    });

  /** Initialize resizer drag logic */
  initResizer: function() {
    var resizer = Utils.el('resizer');
    var overlay = Utils.el('drag-overlay');
    var mapPanel = document.querySelector('.map-panel');
    var main = document.querySelector('.main');
    var dragging = false;

    resizer.addEventListener('mousedown', function(e) {
      e.preventDefault();
      dragging = true;
      resizer.classList.add('active');
      overlay.style.display = 'block';
    });
    document.addEventListener('mousemove', function(e) {
      if (!dragging) return;
      var rect = main.getBoundingClientRect();
      var x = e.clientX - rect.left;
      var pct = (x / rect.width) * 100;
      pct = Math.max(20, Math.min(80, pct));
      mapPanel.style.width = pct + '%';
      if (State.map) State.map.resize();
    });
    document.addEventListener('mouseup', function() {
      if (!dragging) return;
      dragging = false;
      resizer.classList.remove('active');
      overlay.style.display = 'none';
      if (State.map) State.map.resize();
    });
  }
};

    Utils.el('theme-icon').innerHTML = State.isDark
      ? '<path d="M21 12.79A9 9 0 1111.21 3 7 7 0 0021 12.79z"/>'
      : '<circle cx="12" cy="12" r="5"/><line x1="12" y1="1" x2="12" y2="3"/><line x1="12" y1="21" x2="12" y2="23"/><line x1="4.22" y1="4.22" x2="5.64" y2="5.64"/><line x1="18.36" y1="18.36" x2="19.78" y2="19.78"/><line x1="1" y1="12" x2="3" y2="12"/><line x1="21" y1="12" x2="23" y2="12"/><line x1="4.22" y1="19.78" x2="5.64" y2="18.36"/><line x1="18.36" y1="5.64" x2="19.78" y2="4.22"/>';

    var drawColor = Utils.accentColor();
    if (State.map) {
      try {
        State.map.setPaintProperty('sel-fill', 'fill-color', drawColor);
        State.map.setPaintProperty('sel-stroke', 'line-color', drawColor);
        State.map.setPaintProperty('lasso-ln-l', 'line-color', drawColor);
        State.map.setPaintProperty('lasso-pt-l', 'circle-color', drawColor);
        State.map.setPaintProperty('circ-rad-l', 'line-color', drawColor);
        State.map.setPaintProperty('circ-center-l', 'circle-color', drawColor);
        State.map.setPaintProperty('circ-label-l', 'text-color', drawColor);
        State.map.setPaintProperty('circ-label-l', 'text-halo-color', State.isDark ? 'rgba(9,9,11,.85)' : 'rgba(255,255,255,.9)');
        State.map.setPaintProperty('nodes-circle', 'circle-color', State.isDark ? '#fde047' : '#f43f5e');
        State.map.setPaintProperty('nodes-circle', 'circle-stroke-color', '#ffffff');
      } catch(ex) {}
    }

    // Update layer panel swatches for theme
    MapManager.updateLayerSwatches();

    // Update favicon to match theme accent
    var favColor = State.isDark ? '%23facc15' : '%23E91E63';
    var favLink = document.querySelector('link[rel="icon"]');
    if (favLink) favLink.href = "data:image/svg+xml,%3Csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 32 32'%3E%3Ccircle cx='16' cy='16' r='13' stroke='" + favColor + "' stroke-width='2' fill='none' opacity='.6'/%3E%3Ccircle cx='16' cy='16' r='4.5' fill='" + favColor + "' opacity='.85'/%3E%3C/svg%3E";

    MapManager.switchBase(State.isDark ? 'dark' : 'voyager');
  }
};

/* ================================================================
 * MODULE 12: EXPORT ‚Äî CSV export of selected rows
 * ================================================================ */
var Export = {
  csv: function() {
    if (!State.table || !State.selected.size) { alert('No roads selected.'); return; }
    var prev = State.viewMode;
    TableManager.setView('selected');
    State.table.download('csv', 'selected_roads.csv');
    TableManager.setView(prev);
  }
};

/* ================================================================
 * MODULE 13: BOOT ‚Äî Wire all event handlers, init with error handling
 * ================================================================ */
var Boot = {
  showError: function(msg) {
    var el = Utils.el('loading-error');
    el.textContent = msg;
    el.style.display = 'block';
    Utils.el('loading-text').textContent = 'Failed to load';
    document.querySelector('.loading-spinner').style.display = 'none';
  },

  dismiss: function() {
    var overlay = Utils.el('loading');
    overlay.classList.add('hide');
    setTimeout(function() { overlay.style.display = 'none'; }, 500);
  },

  wireUI: function() {
    // Context menu
    document.addEventListener('click', UI.hideCtx);
    document.addEventListener('scroll', UI.hideCtx, true);
    Utils.el('ctx-zoom').onclick = function(e) { e.stopPropagation(); if (State.ctxFid != null) MapManager.flyTo(State.ctxFid); UI.hideCtx(); };
    Utils.el('ctx-sel').onclick  = function(e) { e.stopPropagation(); if (State.ctxFid != null) Selection.toggle(State.ctxFid); UI.hideCtx(); };
    Utils.el('ctx-copy').onclick = function(e) { e.stopPropagation(); if (State.ctxFid != null && State.features[State.ctxFid]) navigator.clipboard.writeText(State.features[State.ctxFid].properties.Name || '').catch(function(){}); UI.hideCtx(); };
    Utils.el('ctx-clr').onclick  = function(e) { e.stopPropagation(); Selection.clearAll(); UI.hideCtx(); };

    // Measure panel minimize/maximize toggle
    Utils.el('measure-toggle').onclick = function(e) {
      e.stopPropagation();
      var panel = Utils.el('measure-panel');
      var btn = Utils.el('measure-toggle');
      panel.classList.toggle('collapsed');
      btn.title = panel.classList.contains('collapsed') ? 'Maximize' : 'Minimize';
    };

    // County selector dropdown (portaled to body)
    var countyMenu = Utils.el('county-menu');
    var countyBtn = Utils.el('county-btn');
    function openCountyMenu() {
      var r = countyBtn.getBoundingClientRect();
      countyMenu.style.top = (r.bottom + 6) + 'px';
      countyMenu.style.left = (r.left + r.width / 2) + 'px';
      countyMenu.style.transform = 'translateX(-50%)';
      countyMenu.classList.add('open');
      Utils.el('county-wrap').classList.add('open');
    }
    function closeCountyMenu() {
      countyMenu.classList.remove('open');
      Utils.el('county-wrap').classList.remove('open');
    }
    countyBtn.onclick = function(e) {
      e.stopPropagation();
      if (countyMenu.classList.contains('open')) closeCountyMenu();
      else openCountyMenu();
    };
    document.querySelectorAll('.county-item').forEach(function(item) {
      item.onclick = function(e) {
        e.stopPropagation();
        var val = item.dataset.county;
        document.querySelectorAll('.county-item').forEach(function(i) { i.classList.remove('active'); });
        item.classList.add('active');
        Utils.el('county-label').textContent = item.textContent.trim();
        closeCountyMenu();
        var bounds = Config.COUNTY_BOUNDS[val];
        if (bounds && State.map) {
          State.map.fitBounds(bounds, {padding: 40, duration: 1200});
        }
      };
    });
    document.addEventListener('click', function(e) {
      if (!countyMenu.contains(e.target) && !countyBtn.contains(e.target)) closeCountyMenu();
    });

    // Clear All
    Utils.el('btn-clear').onclick = Selection.clearAll;

    // Map full-view toggle
    Utils.el('btn-expand').onclick = function() {
      var main = document.querySelector('.main');
      if (main.classList.contains('tbl-full')) {
        main.classList.remove('tbl-full');
        Utils.el('btn-tbl-expand').innerHTML = '<svg width="13" height="13" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><polyline points="15 3 21 3 21 9"/><polyline points="9 21 3 21 3 15"/><line x1="21" y1="3" x2="14" y2="10"/><line x1="3" y1="21" x2="10" y2="14"/></svg> Expand';
      }
      var on = main.classList.toggle('map-full');
      this.innerHTML = on
        ? '<svg width="15" height="15" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><polyline points="4 14 10 14 10 20"/><polyline points="20 10 14 10 14 4"/><line x1="14" y1="10" x2="21" y2="3"/><line x1="3" y1="21" x2="10" y2="14"/></svg> Collapse'
        : '<svg width="15" height="15" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><polyline points="15 3 21 3 21 9"/><polyline points="9 21 3 21 3 15"/><line x1="21" y1="3" x2="14" y2="10"/><line x1="3" y1="21" x2="10" y2="14"/></svg> Expand';
      if (State.map) setTimeout(function() { State.map.resize(); }, 50);
    };

    // Table full-view toggle
    Utils.el('btn-tbl-expand').onclick = function() {
      var main = document.querySelector('.main');
      if (main.classList.contains('map-full')) {
        main.classList.remove('map-full');
        Utils.el('btn-expand').innerHTML = '<svg width="15" height="15" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><polyline points="15 3 21 3 21 9"/><polyline points="9 21 3 21 3 15"/><line x1="21" y1="3" x2="14" y2="10"/><line x1="3" y1="21" x2="10" y2="14"/></svg> Expand';
      }
      var on = main.classList.toggle('tbl-full');
      this.innerHTML = on
        ? '<svg width="13" height="13" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><polyline points="4 14 10 14 10 20"/><polyline points="20 10 14 10 14 4"/><line x1="14" y1="10" x2="21" y2="3"/><line x1="3" y1="21" x2="10" y2="14"/></svg> Collapse'
        : '<svg width="13" height="13" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><polyline points="15 3 21 3 21 9"/><polyline points="9 21 3 21 3 15"/><line x1="21" y1="3" x2="14" y2="10"/><line x1="3" y1="21" x2="10" y2="14"/></svg> Expand';
      if (State.table) setTimeout(function() { State.table.redraw(true); }, 50);
      if (State.map) setTimeout(function() { State.map.resize(); }, 100);
    };

    // View toggle
    Utils.el('vt-all').addEventListener('click', function(e) { e.stopPropagation(); TableManager.setView('all'); });
    Utils.el('vt-sel').addEventListener('click', function(e) { e.stopPropagation(); TableManager.setView('selected'); });

    // Search
    Utils.el('search').oninput = function() { TableManager.applyFilter(); };

    // Export
    Utils.el('btn-csv').onclick = Export.csv;

    // Theme
    Utils.el('btn-theme').onclick = Theme.toggle;

    // Font size
    var fontSize = 12;
    function applyFontSize(sz) {
      fontSize = Math.max(10, Math.min(16, sz));
      document.documentElement.style.setProperty('--tbl-fs', fontSize + 'px');
      Utils.el('font-val').textContent = fontSize;
      if (State.table) State.table.redraw(true);
      if (State.map) {
        var d = fontSize - 12;
        try { State.map.setLayoutProperty('roads-label', 'text-size', ['interpolate',['linear'],['zoom'], 10, 9+d, 13, 11+d, 16, 13+d]); } catch(e) {}
      }
    }
    Utils.el('btn-font-up').onclick = function() { applyFontSize(fontSize + 1); };
    Utils.el('btn-font-down').onclick = function() { applyFontSize(fontSize - 1); };

    // Features modal
    Utils.el('btn-features').onclick = function() {
      if (!Utils.el('feat-body').innerHTML) {
        Utils.el('feat-body').innerHTML = UI.renderFeatures();
      }
      Utils.el('modal-features').classList.add('on');
    };
    Utils.el('feat-close').onclick = function() { Utils.el('modal-features').classList.remove('on'); };
    Utils.el('modal-features').onclick = function(e) { if (e.target === this) this.classList.remove('on'); };

    // Basemap dropdown
    Utils.el('btn-basemap').onclick = function(e) {
      e.stopPropagation();
      var menu = Utils.el('menu-basemap');
      var isOpen = menu.classList.contains('open');
      UI.closeAllDropdowns();
      if (!isOpen) menu.classList.add('open');
    };
    document.querySelectorAll('#menu-basemap .dd-item').forEach(function(b) {
      b.onclick = function(e) { e.stopPropagation(); MapManager.switchBase(b.dataset.bm); UI.closeAllDropdowns(); };
    });

    // Selection dropdown
    Utils.el('btn-select-dd').onclick = function(e) {
      e.stopPropagation();
      var menu = Utils.el('menu-select');
      var isOpen = menu.classList.contains('open');
      UI.closeAllDropdowns();
      if (!isOpen) menu.classList.add('open');
    };
    document.querySelectorAll('#menu-select .dd-item').forEach(function(b) {
      b.onclick = function(e) {
        e.stopPropagation();
        var t = b.dataset.tool;
        SpatialTools.setTool(State.tool === t ? null : t);
        UI.closeAllDropdowns();
      };
    });
    document.addEventListener('click', function() { UI.closeAllDropdowns(); });

    // Layer control
    document.querySelectorAll('.layer-row').forEach(function(row) {
      row.onclick = function(e) {
        e.stopPropagation();
        var on = row.classList.toggle('on');
        var layers = row.dataset.layers.split(',');
        layers.forEach(function(lid) {
          State.layerVis[lid] = on;
          if (State.map && State.map.getLayer(lid)) State.map.setLayoutProperty(lid, 'visibility', on ? 'visible' : 'none');
        });
      };
    });

    // Column visibility
    Utils.el('btn-colvis').onclick = function(e) {
      e.stopPropagation();
      var menu = Utils.el('col-vis-menu');
      var isOpen = menu.classList.contains('open');
      UI.closeAllDropdowns();
      menu.classList.remove('open');
      if (!isOpen) { UI.updateColVisMenu(); menu.classList.add('open'); }
    };
    document.addEventListener('click', function(e) {
      var menu = Utils.el('col-vis-menu');
      if (menu.classList.contains('open') && !menu.contains(e.target) && e.target.id !== 'btn-colvis') {
        menu.classList.remove('open');
      }
    });

    // Add Column modal
    Utils.el('mc-type').onchange = function() {
      Utils.el('mc-dd-wrap').style.display = this.value === 'dropdown' ? 'flex' : 'none';
    };
    Utils.el('btn-addcol').onclick = function() {
      Utils.el('mc-name').value = '';
      Utils.el('mc-def').value = '';
      Utils.el('mc-dd-opts').value = '';
      Utils.el('mc-type').value = 'text';
      Utils.el('mc-dd-wrap').style.display = 'none';
      Utils.el('modal').classList.add('on');
      setTimeout(function() { Utils.el('mc-name').focus(); }, 100);
    };
    Utils.el('mc-cancel').onclick = function() { Utils.el('modal').classList.remove('on'); };
    Utils.el('modal').onclick = function(e) { if (e.target === this) this.classList.remove('on'); };
    Utils.el('modal').onkeydown = function(e) { if (e.key === 'Enter') Utils.el('mc-ok').click(); };
    Utils.el('mc-ok').onclick = function() {
      var name = Utils.el('mc-name').value.trim();
      if (!name) { Utils.el('mc-name').focus(); return; }
      var type = Utils.el('mc-type').value;
      var def  = Utils.el('mc-def').value.trim();
      var opts = [];
      if (type === 'dropdown') {
        opts = Utils.el('mc-dd-opts').value.split(',').map(function(s) { return s.trim(); }).filter(Boolean);
        if (!opts.length) { Utils.el('mc-dd-opts').focus(); return; }
      }
      Utils.el('modal').classList.remove('on');
      Columns.addCol(name, type, opts, def);
    };

    // Column Math modal
    Utils.el('btn-colmath').onclick = function() {
      var cols = Columns.getNumericColumns();
      if (cols.length < 1) { alert('You need at least one numeric column.'); return; }
      State._editingFormulaField = null;
      Utils.el('cm-ok').textContent = 'Create Column';
      Utils.el('cm-name').value = '';
      Utils.el('cm-round').value = 'none';
      Utils.el('cm-dec').value = '2';
      Utils.el('cm-const-wrap').style.display = 'none';
      UI.populateMathDropdowns();
      Utils.el('modal-math').classList.add('on');
      setTimeout(function() { Utils.el('cm-name').focus(); }, 100);
    };
    Utils.el('cm-cancel').onclick = function() { Utils.el('modal-math').classList.remove('on'); State._editingFormulaField = null; };
    Utils.el('modal-math').onclick = function(e) { if (e.target === this) { this.classList.remove('on'); State._editingFormulaField = null; } };
    Utils.el('modal-math').onkeydown = function(e) { if (e.key === 'Enter') Utils.el('cm-ok').click(); };
    Utils.el('cm-a').onchange = UI.updateMathPreview;
    Utils.el('cm-b').onchange = UI.updateMathPreview;
    Utils.el('cm-op').onchange = UI.updateMathPreview;
    Utils.el('cm-const').oninput = UI.updateMathPreview;
    Utils.el('cm-round').onchange = UI.updateMathPreview;
    Utils.el('cm-ok').onclick = function() {
      var name = Utils.el('cm-name').value.trim();
      if (!name) { Utils.el('cm-name').focus(); return; }
      var fieldA = Utils.el('cm-a').value;
      var fieldB = Utils.el('cm-b').value;
      var isConst = fieldB === '_CONST_';
      var constVal = isConst ? (parseFloat(Utils.el('cm-const').value) || 0) : 0;
      if (isConst && Utils.el('cm-const').value.trim() === '') { Utils.el('cm-const').focus(); return; }
      var op  = Utils.el('cm-op').value;
      var dec = parseInt(Utils.el('cm-dec').value) || 2;
      var rnd = Utils.el('cm-round').value;
      Utils.el('modal-math').classList.remove('on');
      if (State._editingFormulaField) {
        Columns.updateFormula(State._editingFormulaField, name, fieldA, fieldB, isConst, constVal, op, dec, rnd);
        State._editingFormulaField = null;
      } else {
        Columns.addMathCol(name, fieldA, fieldB, isConst, constVal, op, dec, rnd);
      }
    };

    // Resizer
    UI.initResizer();
  },

  wireKeyboard: function() {
    document.addEventListener('keydown', function(e) {
      // Escape handling
      if (e.key === 'Escape') {
        if (Utils.el('modal-features').classList.contains('on')) Utils.el('modal-features').classList.remove('on');
        else if (Utils.el('modal').classList.contains('on')) Utils.el('modal').classList.remove('on');
        else if (Utils.el('modal-math').classList.contains('on')) Utils.el('modal-math').classList.remove('on');
        else if (State.tool) SpatialTools.setTool(null);
        UI.closeAllDropdowns();
        UI.hideCtx();
        if (State.focusedCell) CellNav.setFocusedCell(null);
        return;
      }

      var tag = document.activeElement ? document.activeElement.tagName : '';
      var inTableEditor = document.activeElement && document.activeElement.closest && document.activeElement.closest('.tabulator-editing');
      var inSearch = document.activeElement === Utils.el('search');
      var inModal = document.activeElement && document.activeElement.closest && document.activeElement.closest('.modal-bg');

      if ((tag === 'INPUT' || tag === 'SELECT' || tag === 'TEXTAREA') && !inTableEditor) return;
      if (inSearch || inModal) return;

      // Arrow keys ‚Äî navigate (not editing)
      if (!inTableEditor && State.focusedCell) {
        if (e.key === 'ArrowUp')    { e.preventDefault(); CellNav.navigateCell(-1, 0); return; }
        if (e.key === 'ArrowDown')  { e.preventDefault(); CellNav.navigateCell(1, 0); return; }
        if (e.key === 'ArrowLeft')  { e.preventDefault(); CellNav.navigateCell(0, -1); return; }
        if (e.key === 'ArrowRight') { e.preventDefault(); CellNav.navigateCell(0, 1); return; }
        if (e.key === 'Tab') { e.preventDefault(); CellNav.navigateCell(0, e.shiftKey ? -1 : 1); return; }
        if (e.key === 'Enter') { e.preventDefault(); try { State.focusedCell.edit(); } catch(ex) {} return; }
      }

      // While editing: arrow keys exit editor and navigate
      if (inTableEditor && State.focusedCell) {
        if (e.key === 'ArrowUp') {
          e.preventDefault();
          try { document.activeElement.blur(); } catch(ex) {}
          setTimeout(function() { CellNav.navigateCell(-1, 0); }, 30);
          return;
        }
        if (e.key === 'ArrowDown') {
          e.preventDefault();
          try { document.activeElement.blur(); } catch(ex) {}
          setTimeout(function() { CellNav.navigateCell(1, 0); }, 30);
          return;
        }
        if (e.key === 'ArrowLeft') {
          e.preventDefault();
          try { document.activeElement.blur(); } catch(ex) {}
          setTimeout(function() { CellNav.navigateCell(0, -1); }, 30);
          return;
        }
        if (e.key === 'ArrowRight') {
          e.preventDefault();
          try { document.activeElement.blur(); } catch(ex) {}
          setTimeout(function() { CellNav.navigateCell(0, 1); }, 30);
          return;
        }
      }
    }, true);
  },

  start: function() {
    var missing = [];
    if (typeof maplibregl === 'undefined') missing.push('MapLibre GL JS');
    if (typeof turf === 'undefined') missing.push('Turf.js');
    if (typeof Tabulator === 'undefined') missing.push('Tabulator');
    if (missing.length) {
      Boot.showError('Failed to load: ' + missing.join(', ') + '. Check your internet connection.');
      return;
    }
    Utils.el('loading-text').textContent = 'Initializing‚Ä¶';
    Boot.wireUI();
    Boot.wireKeyboard();
    try { MapManager.init(); } catch(e) { Boot.showError('Map init failed: ' + e.message); }
  }
};

// === GO ===
Boot.start();
</script>
